('1','1','1','Baza',NULL,'baza',NULL,NULL,NULL),
('2','1','1','Strona główna',NULL,'strona-glowna',NULL,NULL,NULL),
('28','1','1','AGD','AGD','agd',NULL,NULL,NULL),
('29','1','1','Artykuły biurowe','Artykuły biurowe','artykuly-biurowe',NULL,NULL,NULL),
('30','1','1','Dom i Ogród','Dom i Ogród','dom-i-ogrod',NULL,NULL,NULL),
('31','1','1','Drukarka i Akcesoria ','Drukarka i Akcesoria ','drukarka-i-akcesoria-',NULL,NULL,NULL),
('32','1','1','Airfryer','Szukasz frytkownicy powietrznej lub akcesoriów do niej w atrakcyjnej cenie? Tutaj znajdziesz duży wybór frytownic powietrznych dla małych i dużych rodzin od najlepszych producentów, takich jak Philips, OBH Nordica, Russell Hobbs, Cosori, Princess, Ninja i nie tylko. Zapoznaj się z naszą ofertą lub przeczytaj więcej o tym, jak korzystać z frytkownicy powietrznej poniżej.','airfryer',NULL,NULL,NULL),
('33','1','1','Czajnik elektryczny','Czajnik elektryczny jest najpopularniejszym małym AGD występującym w kuchni, w każdym gospodarstwie domowym. Zamiast podgrzewać wodę w garnku, czajnik elektryczny doprowadza wodę do wrzenia znacznie szybciej, a tym samym bardziej energooszczędnie. W mgnieniu oka możesz przygotować wodę na herbatę lub kawę.','czajnik-elektryczny',NULL,NULL,NULL),
('34','1','1','Dekoracje','Kochasz dom, projektowanie wnętrz i wystroju? A może po prostu szukasz konkretnych dodatków do domu? Tak czy inaczej, postaramy się zainspirować Cię i podrzucić nowe pomysły do Twojego wnętrza.','dekoracje',NULL,NULL,NULL),
('35','1','1','Garnki','Na Proshop mamy duży wybór garnków. U nas nacisk kładziony jest szczególnie na jakość oferowanych produktów. Możesz mieć pewność, że na naszej stronie internetowej znajdziesz świetne oferty.','garnki',NULL,NULL,NULL),
('36','1','1','Grill stołowy','Kiedy tylko pojawiają się pierwsze ciepłe dni po zimie jedyne, o czym myślimy to sezon grillowy. Ale czy nie byłoby miło mieć możliwość jedzenia pysznych dań z grilla w środku zimy?','grill-stolowy',NULL,NULL,NULL),
('37','1','1','Krajalnica','Jeśli chcesz pociąć wędliny do zamrożenia lub po prostu chcesz zrobić własny pyszny talerz wędlin, spodoba Ci się krajalnica do wędlin. Wiele osób kroi jedynie mięso na krajalnicy. Wiedziałeś, że można używać jej również do chleba, sera i warzyw? To sprawia, że jest bardzo wszechstronna. Dzięki temu proces krojenia jest znacznie szybszy i dokładniejszy niż w przypadku cięcia ręcznego.Większość modeli wyposażona jest w nóż ze stali nierdzewnej, który można dopasować do różnych grubości, dzięki czemu osiągniesz dokładnie taki rezultat, jakiego zapragniesz. Dla Twojego bezpieczeństwa wszystkie modele wyposażone są również w osłonę na nóż, tak aby uniemożliwić ukrojenie niewłaściwych rzeczy.Niektóre modele można złożyć, co ułatwia ich przechowywanie w szafce z tosterem i jajowarem.','krajalnica',NULL,NULL,NULL),
('38','1','1','Kuchenka mikrofalowa, mini piekarnik','Kuchenki mikrofalowe stają się coraz bardziej funkcjonalne. Kuchenki mikrofalowe mogą być używane do rozmrażania, podgrzewania i gotowania potraw. Można również otrzymać kuchenki mikrofalowe z funkcją grilla lub kuchenki mikrofalowe z grillem i konwekcją, które mają wszystkie zalety konwencjonalnych pieców. Łącząc mikrofale z konwekcją można znacznie skrócić czas gotowania.Mikrofalówki można dostać jako wolnostojące lub wbudowane od producentów takich jak Samsung, Electrolux, Whirlpool i Bosch. Mikrofalówki i mini piekarniki są dostępne w różnych rozmiarach od około 17 do 32 litrów. Ważne jest, abyś znał swoje potrzeby, wielkość naczyń i tym podobne, aby zostały zaspokojone przez wybraną kuchenkę mikrofalową.','kuchenka-mikrofalowa-mini-piekarnik',NULL,NULL,NULL),
('39','1','1','Maszyna kuchenna - akcesoria','Po zakupie dobrego urządzenia kuchennego warto zainwestować w niektóre akcesoria. Istnieją prawie niekończące się opcje i można znaleźć wiele ciekawych nowych opcji bez opróżniania konta bankowego. Jeśli wybrałeś urządzenie kuchenne z mocnym silnikiem, nie będziesz miał żadnych problemów, bez względu na to, czy chcesz zrobić domowe mięso mielone, czy zmiażdżyć lód na drinki.Dzięki akcesoriom do urządzenia kuchennego nie musisz inwestować w inne maszyny kuchenne ani w inne urządzenia kuchenne w swojej kuchni. Możesz zrobić makaron, posiekać warzywa na sałatkę, zrobić sok, zmiksować smoothie lub zrobić lody i sorbet.','maszyna-kuchenna---akcesoria',NULL,NULL,NULL),
('40','1','1','Odkurzacz piorący',' ','odkurzacz-pioracy',NULL,NULL,NULL),
('41','1','1','Odkurzacz ręczny','Odkurzacz ręczny jest bardzo dobrym rozwiązaniem dla osób, które potrzebują szybko i łatwo odkurzyć niewielkie pomieszczenia, mieszkania, a nawet auta. Ręczne odkurzacze to alternatywa dla zwykłych odkurzaczy domowych, jednak potrafią być one dużo bardziej wygodne w użytkowaniu. Często ręczne odkurzacze są nazywane odkurzaczami pionowymi z racji swojej budowy lub odkurzaczami bezprzewodowymi. Najpopularniejsze odkurzacze ręczne produkują takie marki, jak: Dyson, Philips, Bosch, czy AEG. ','odkurzacz-reczny',NULL,NULL,NULL),
('42','1','1','Opiekacz do kanapek','Przepis na dobry tost jest tak prosty, że nawet najmłodsi w rodzinie mogą go zrobić. Oznacza to, że większość dzieci i młodzieży lubi gorące przekąski.','opiekacz-do-kanapek',NULL,NULL,NULL),
('43','1','1','Patelnia','Znalezienie odpowiedniej patelni nie jest tak łatwe, jak mogłoby się wydawać. Występują one we wszystkich kształtach i rozmiarach oraz służą do różnych celów. Być może potrzebujesz klasycznej patelni? A może szukasz patelni wok, patelni z grillem, a może czegoś zupełnie innego? Nie martw się, mamy wszystko w Proshop i po niskiej cenie.Dobra patelnia jest niezbędna w każdej kuchni. Jeśli kupisz taką, która jest dobrej jakości, będzie Ci służyć na pewno przez wiele lat. Dobrym pomysłem może być zakup patelni non-stick, aby sprzątanie po gotowaniu stało się jeszcze prostsze.Oferujemy produkty od np. OBH Nordica i Tefal, ale mamy również na stronie produkty od innych producentów.Jeśli szukasz nowego sprzętu do kuchni, to powinieneś rzucić okiem na nasz duży wybór garnków, frytownic, mikserów, jak i ekspresów do kawy. Jeśli chcesz, aby gotowanie było fajne, możesz również znaleźć na naszej stronie saturatory, gofrownice i maszyny/kostkarki do lodów. Czyszczenie stanie się łatwe dzięki odkurzaczowi ręcznemu, odkurzaczowi parowemu lub odkurzaczowi robot.','patelnia',NULL,NULL,NULL),
('44','1','1','Przybory kuchenne','Na tej stronie znajdziesz wszystkie niezbędne przybory kuchenne. Mamy narzędzia dla wszystkich fanów gotowania, a z nimi gotowanie staje się jeszcze łatwiejsze i przyjemniejsze. U nas otrzymasz wszystkie przybory kuchenne w przystępnych cenach.','przybory-kuchenne',NULL,NULL,NULL),
('45','1','1','Saturator','Jeśli chcesz zrobić wodę sodową lub gazowaną w domu, powinieneś zainwestować w saturator. Napełnij butelkę wodą, dodaj dwutlenek węgla i wybrany smak. To takie proste. Sodastream jest najbardziej znanym producentem i nie bez powodu.Jeśli zabrakło Ci dwutlenku węgla, potrzebujesz koncentratu sodowego lub części zamiennej, jesteś we właściwym miejscu. Jeśli nie możesz znaleźć tego, czego potrzebujesz, możesz napisać lub zadzwonić do naszego Biura Obsługi Klienta.','saturator',NULL,NULL,NULL),
('46','1','1','Sokowirówka, wyciskarka do owoców','Sokowirówka, wyciskarka do owoców','sokowirowka-wyciskarka-do-owocow',NULL,NULL,NULL),
('47','1','1','Termos','Znajdź idealny termos na Twoją ulubioną kawę lub herbatę albo termos dla dziecka na gorące kakao! W chłodne dni termos jest wart złota. Może upiększyć i rozgrzać codzienne życie w biegu i długie poranki w biurze.','termos',NULL,NULL,NULL),
('48','1','1','Toster','Toster','toster',NULL,NULL,NULL),
('49','1','1','Urządzenie wielofuncyjne do gotowania','Kuchnia często wypełniona jest garnkami, patelniami i naczyniami do wszelkiego rodzaju gotowania. Dzięki multicookerowi unikniesz konieczności posiadania różnych rodzajów garnków i patelni. Możesz zaopatrzyc się w jeden produkt, dzięki któremu przygotujesz większość potraw. Multicooker to produkt, który może uprościć gotowanie, więc nie musisz pilnować kuchenki, ale możesz zamiast tego pozwolić multicookerowi zakończyć pracę.Posiadamy szeroką gamę multicookerów we wszystkich kolorach i z wieloma różnymi możliwościami od producentów takich jak Redmond, Krups i DeLonghi. Wybierając wielofunkcyjne urządzenie do gotowania, warto sprawdzić, jaką ma moc, ponieważ daje to wyobrażenie o tym, jak efektywne będzie gotowanie. Ponadto ważne jest, aby zwrócić uwagę na programy i funkcje, które oferują poszczególne modele. W tym przypadku szczególnie wygodnie jest wybrać model samoczyszczący, dzięki czemu nie trzeba myć naczyń po zakończeniu gotowania.','urzadzenie-wielofuncyjne-do-gotowania',NULL,NULL,NULL),
('50','1','1','Akcesoria do biura','Biuro jest miejscem dla pracy i hobby, które wymaga skupienia i ciszy. Inne pomieszczenia czasem nie oferują takich warunków. Centralnym elementem biura jest biurko, a to nie tylko stół ze stosem papierów, ale zorganizowane miejsce pracy, z którego można spokojnie wykonywać swoje obowiązki.','akcesoria-do-biura',NULL,NULL,NULL),
('51','1','1','Ergonomia','Wygoda w miejscu pracy zapewnia lepsze samopoczucie i zwiększa wydajność pracy. Sprawdź naszą ofertę produktów ergonomicznych do zastosowań biurowych i zainwestuj w lepszą ergonomię, a zapewni to jeszcze więcej zysków.','ergonomia',NULL,NULL,NULL),
('52','1','1','Kalendarz','Kalendarz','kalendarz',NULL,NULL,NULL),
('53','1','1','Kalkulator','Tutaj znajdziesz duży wybór najlepszych kalkulatorów w niskiej cenie.Jeśli się uczysz lub wykonujesz w pracy wiele obliczeń, dobrze jest mieć pod ręką kalkulator. Wiele osób wykonuje dzisiaj obliczenia na laptopie lub komputerze stacjonarnym, ale to kalkulator jest zawsze niezawodny i łatwy do zabrania ze sobą.','kalkulator',NULL,NULL,NULL),
('54','1','1','Kasy','Dobra kasa fiskalna jest koniecznością w większości sklepów fizycznych w wielu różnych branżach, niezależnie od tego, czy chodzi o sklep, kawiarnię, restaurację, sklep odzieżowy czy mały sklep spożywczy. Możliwości jest wiele dzięki prostemu i inteligentnemu rejestrowi, który może zaspokoić Twoje potrzeby.','kasy',NULL,NULL,NULL),
('55','1','1','Kontrola czasu i obecności','Kontrola czasu i obecności','kontrola-czasu-i-obecnosci',NULL,NULL,NULL),
('56','1','1','Koperty & Kartony','Koperty &amp; Kartony','koperty-kartony',NULL,NULL,NULL),
('57','1','1','Koszulki, ofertówki i przekładki','Posiadasz dużo dokumentów i papierów w nieładzie? Uporządkuj je dzięki koszulkom i przekładkom, które idealnie nadają się do segregatorów i pojemników. W Proshop znajdziesz wiele wysokiej jakości plastikowych koszulek, przekładek, pokrowców na dokumenty i do zapisów do archiwizacji dokumentów.','koszulki-ofertowki-i-przekladki',NULL,NULL,NULL),
('58','1','1','Materiały do pakowania','Materiały do pakowania','materialy-do-pakowania',NULL,NULL,NULL),
('59','1','1','Niszczarka dokumentów','Jeśli szukasz niszczarki do domu lub biura, na pewno znajdziesz u nas odpowiedni produkt. Wybierając niszczarkę dokumentów lub niszczarkę do cięcia poprzecznego, dobrze jest sprawdzić na ile kawałków, jest w stanie pociąć papier. To decyduje o poziomie bezpieczeństwa, do czego można jej użyć. ','niszczarka-dokumentow',NULL,NULL,NULL),
('60','1','1','Przędza i akcesoria','Przędza i akcesoria','przedza-i-akcesoria',NULL,NULL,NULL),
('61','1','1','Przybory do pisania i rysowania','Chcesz wyposażyć swoje miejsce pracy lub swoje dziecko na cały rok szkolny i potrzebne są wszelkiego rodzaju materiały szkolne i materiały do pisania? W naszej ofercie znajdziesz wszystko, czego potrzebujesz! W Proshop posiadamy szeroki wybór przyborów do pisania i rysowania w rozsądnych cenach nawet dla najmłodszych oraz do każdego biura.','przybory-do-pisania-i-rysowania',NULL,NULL,NULL),
