('69','1','1','Łuparki do drewna','Drewno możesz siekać siekierą, jednak zadanie to jest znacznie łatwiejsze przy użyciu rozłupywarki, jeśli potrzebujesz drewna ciętego na więcej, niż tylko małe ognisko ogrodowe.','luparki-do-drewna',NULL,NULL,NULL),
