('72','1','1','Myjka wysokociśnieniowa','Chociaż może być kuszące kupowanie nowych płytek, gdy taras jest pokryty glonami, często wystarczy go wyczyścić za pomocą myjki wysokociśnieniowej. Posiadamy szeroki asortyment myjek wysokociśnieniowych producentów takich jak Nilfisk i Kärcher w różnych przedziałach cenowych.Myjką wysokociśnieniową można czyścić również samochody i maszyny ogrodowe, takie jak kosiarki. Ważne jest, aby kupić odpowiednie akcesoria do myjki. Na przykład w Proshop znajdziesz mydła i szczotki do mycia samochodu lub środki do czyszczenia tarasów.','myjka-wysokocisnieniowa',NULL,NULL,NULL),
('73','1','1','Narzędzia pomiarowe','Narzędzia pomiarowe','narzedzia-pomiarowe',NULL,NULL,NULL),
('74','1','1','Narzędzia wielofunkcyjne','Narzędzia wielofunkcyjne','narzedzia-wielofunkcyjne',NULL,NULL,NULL),
('75','1','1','Odśnieżarki','Czy jesteś zmęczony ręcznym odśnieżaniem w zimę? Na ## ConceptId ## znajdziesz szeroki wybór różnych odśnieżarek znanych marek, takich jak McCulloch. Pługi śnieżne wyposażone są w silnik, który zarówno odrzuca śnieg, jak i porusza się do przodu, więc nie musisz nic robić, tylko go sterować i cieszyć się jazdą. Odśnieżarka sprawdzi się zatem, jeśli masz większy obszar, który zostaje szybko pokryty śniegiem, na przykład duży podjazd lub chodnik.Szukając odśnieżarek, dobrym pomysłem jest znalezienie maszyny pasującej do szerokości chodnika. Wtedy cały chodnik zostanie oczyszczony za jednym zamachem.Znajdziesz także wiele innych rzeczy, które pozwolą Ci zachować porządek w ogrodzie na ## ConceptId ##. Zobacz na przykład naszą ofertę kosiarek, myjek wysokociśnieniowych i traktorów ogrodowych.','odsniezarki',NULL,NULL,NULL),
('76','1','1','Ogrzewacz ogrodowy','Ogrzewacz ogrodowy','ogrzewacz-ogrodowy',NULL,NULL,NULL),
('77','1','1','Opalarka','Tutaj znajdziesz szeroką gamę opalarek od takich producentów jak Bosch, Dewalt i Makita.  Opalarka jest skutecznym narzędziem i może zrobić znacznie więcej, niż tylko usunąć pozostałości kleju, farby lub oleju, a także odmrażać rury wodne. Na przykład możesz jej używać do zmiękczania plastiku lub PCV, dzięki czemu można go łatwo zginać i kształtować. Można jej użyć do woskowania nart lub snowboardu, a także do zapalania grilla.Kupując opalarkę, warto ją poszukać w regulowanej temperaturze. Oznacza to, że nie nagrzewa się stale, na przykład do 500 stopni. W związku z tym poszukaj takiej, którą można dostosować miedzy 300 i 600 stopni. Ponadto dobre jest to, aby dobra opalarka miała  moc co najmnie 1800 W, wtedy będzie skuteczna w wielu różnych zadaniach.','opalarka',NULL,NULL,NULL),
('78','1','1','Piła szablasta','Piła szablasta rzadko jest pierwszym narzędziem, w które inwestujesz, ale jest naprawdę dobrym narzędziem do zadań, które wymagają trochę więcej niż to, z czym może sobie poradzić piła ręczna. Nasza oferta jest pełna produktów od największych marek takich jak Bosch, Makita alub Einhell.Piła szablasta jest szczególnie przydatna w przypadku zadań trudnodostępnych, ale w których potrzebna jest mocna piła. Dlatego piła jest niezbędna do dużych zadań budowlanych, takich jak praca pod krokwiami.Jeśli szukasz innych pił, mamy również duży wybór pił tarczowych, wyrzynarek, pił łańcuchowych i pił/pilarek ukośnych oraz wiele innych narzędzi.','pila-szablasta',NULL,NULL,NULL),
('79','1','1','Podkaszarka do trawy','Nawet jeśli kosiarka przytnie dobrze trawę, krawędzie trawnika nadal mogą wyglądać nieestetycznie. W przypadku krawędzi trymer do trawy jest często dobrym rozwiązaniem. Posiadamy duży wybór nożyc do trawy od takich producentów jak Ryobi, Makita, Bosch i Gardena.Wybierając nowy trymer do trawy, ważne jest, aby zastanowić się, czy chcesz model zasilany na baterie, czy też z kablem. Każdy model ma swoje wady i zalety. Trymer zasilany z akumulatora ma określoną pojemność akumulatora, co oznacza, że można go używać tylko tak długo, jak długo utrzymuje się akumulator. Z drugiej strony, w przypadku modelu napędzanego akumulatorem, w przeciwieństwie do trymera do trawy z przewodem, unikasz kłopotów z przesuwaniem kabla i ryzykiem przypadkowego przecięcia przewodu.','podkaszarka-do-trawy',NULL,NULL,NULL),
('80','1','1','Rozdrabniacz - ogród','Po dniu spędzonym w ogrodzie przy przycinaniu lub ścinaniu gałęzi piłą łańcuchową, zawsze pozostaje dużo odpadów, których musisz się pozbyć. Zamiast wywozić je lub palić, możesz nabyć niszczarkę ogrodową, która zamieni większe odpady organiczne w wartościowy surowiec kompostowy.','rozdrabniacz-ogrod',NULL,NULL,NULL),
('81','1','1','Skrzynki narzędziowe i systemy przechowywania','Skrzynki narzędziowe i systemy przechowywania','skrzynki-narzedziowe-i-systemy-przechowywania',NULL,NULL,NULL),
('82','1','1','Akcesoria do drukarek','Szukasz akcesoriów dla swojej drukarki lub potrzebujesz nowego sprzętu do swojego biura? W Proshop zawsze mamy duży wybór tanich akcesoriów do większości modeli drukarek. Jeśli nie możesz znaleźć konkretnego podzespołu lub potrzebujesz wskazówek dotyczących najlepszego rozwiązania, możesz napisać lub zadzwonić do naszego Biura Obsługi Klienta.','akcesoria-do-drukarek',NULL,NULL,NULL),
('83','1','1','Drukarka 3D','Drukarka 3D','drukarka-3d',NULL,NULL,NULL),
('84','1','1','Drukarka wielkoformatowa','Drukarka wielkoformatowa','drukarka-wielkoformatowa',NULL,NULL,NULL),
('85','1','1','Filament - Drukarka 3D','Podobnie jak zwykła drukarka atramentowa, drukarka 3D również potrzebuje materiałów eksploatacyjnych, aby wydrukować pożądany produkt. Zamiast toneru lub pojemnika z tuszem, drukarka 3D wykorzystuje różne typy plastikowych włókien na rolkach lub cieczy żywicznej.Jako początkujący najłatwiej i najtaniej jest pracować z drukarką FFF/FDM. Dwa najczęściej używane materiały do drukowania to PLA i ABS. PLA jest mniej elastycznym materiałem niż ABS. Ze względu na niższą temperaturę topnienia, PLA nie wymaga płyty grzewczej i jest ogólnie łatwiejsza w obróbce niż ABS. Zaletą ABS jest większa elastyczność materiału i jego wytrzymałość.Wybierając filament do drukarki, ważne jest, aby zwrócić uwagę na następujące elementy. Czy Twoja drukarka obsługuje tylko oryginalne filamenty, czy również zamienniki? Jaką grubość żarnika zużywa twoja drukarka - 1.75mm? Ile gramów potrzebujesz i w jakich kolorach?Rolki filamentowe pochodzą od wielu różnych producentów. Możliwe jest uzyskanie zarówno oryginalnego filamentu, jak i zamienników. Niektóre drukarki obsługują tylko oryginalne szpule od producenta drukarki, ale coraz więcej drukarek obsługuje obecnie również zamienniki. Producenci tacy jak Verbatim, Prima i Inno3D produkują wysokiej jakości zamienniki. Jeśli drukarka obsługuje zamienniki, można również użyć oryginalnego filamentu z dowolnej innej marki.Jeśli potrzebujesz płynu żywicznego do drukarki SLA, na naszej stronie internetowej znajdziesz szeroki wybór. Drukarka SLA osiąga bardziej profesjonalny wynik niż drukarka FFF/FDM. Drukarka SLA używa lasera do utwardzania światłoczułej cieczy żywicznej i tworzenia przedmiotu w 3D. Kupując żywicę do drukarki 3D, warto kupić oryginalny płyn na bazie żywicy. Zapewnia to wyższą jakość druku i dłuższą żywotność drukarki SLA.Jeśli skończył Ci się filament do Twojego 3D-Pen, to dobrze trafiłeś. Filament do pióra, do drukowania 3D jest dostarczany w małych prętach umieszczonych na końcu długopisu. Istnieje możliwość zakupu zestawów żarników w różnych kolorach lub zestawach jednokolorowych.','filament---drukarka-3d',NULL,NULL,NULL),
('86','1','1','Kabel USB','W Proshop zawsze mamy szeroki wybór kabli USB. Mamy wiele różnych kolorów, długości i typów.','kabel-usb',NULL,NULL,NULL),
('87','1','1','Skaner','Skaner','skaner',NULL,NULL,NULL);
