INSERT INTO `ps_cms_lang` VALUES
('1','1','1','Dostawa',NULL,'Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<h2>Przesyłki i zwroty</h2>\n<h3>Twoja paczka do wysyłki</h3>\n<p>Paczki są zazwyczaj wysyłane w ciągu 2 dni od otrzymania płatności i są wysyłane za pośrednictwem firmy DHL z numerem śledzenia oraz bez konieczności podpisu podczas odbioru. Dostarczymy Ci link umożliwiający śledzenie paczki online.</p>\n<p></p>\n<p>Opłaty za wysyłkę obejmują opłaty manipulacyjne, koszty pakowania oraz opłaty pocztowe. Opłaty manipulacyjne są stałe, natomiast opłaty transportowe zależą od łącznej wagi przesyłki. Zalecamy grupowanie przedmiotów w jednym zamówieniu. Nie możemy łączyć dwóch odrębnych zamówień złożonych osobno, a opłaty za wysyłkę zostaną naliczone dla każdego z nich. Twoja paczka zostanie wysłana na Twoje ryzyko, ale podejmujemy szczególne środki ostrożności, aby zabezpieczyć przedmioty łamliwe.</p>\n<p></p>\n<p>Pudełka są odpowiednio duże, a Twoje przedmioty są dobrze chronione.</p>','dostawa'),
('2','1','1','Nota prawna',NULL,'Legal notice','notice, legal, credits','<h2>Prawo</h2>\n<h2>Autorstwo</h2>\n<h2>Koncepcja i produkcja:</h2>\n<h2></h2>\n<h2>Ta strona internetowa została stworzona przy użyciu otwartoźródłowego oprogramowania<span style=\"font-size:11px;\"> </span><a href=\"http://www.prestashop.com\" style=\"font-size:11px;\">PrestaShop</a><span style=\"font-size:11px;\">™.</span></h2>','nota-prawna'),
('3','1','1','Regulamin',NULL,'Our terms and conditions of use','conditions, terms, use, sell','<h2>Regulamin</h2>\n<h2>REGULAMIN SKLEPU INTERNETOWEGO PROSHOP.PL</h2>\n<h2>REGULAMIN SKLEPU INTERNETOWEGO</h2>\n<h2></h2>\n<h2>PROSHOP.PL</h2>\n<h2></h2>\n<h2>SPIS TREŚCI:</h2>\n<h2></h2>\n<h2>POSTANOWIENIA OGÓLNE</h2>\n<h2>USŁUGI ELEKTRONICZNE W SKLEPIE INTERNETOWYM</h2>\n<h2>WARUNKI ZAWIERANIA UMOWY SPRZEDAŻY</h2>\n<h2>SPOSOBY I TERMINY PŁATNOŚCI ZA PRODUKT</h2>\n<h2>KOSZT, SPOSOBY I TERMIN DOSTAWY PRODUKTU</h2>\n<h2>PROCEDURA ROZPATRYWANIA REKLAMACJI</h2>\n<h2>POZASĄDOWE SPOSOBY ROZPATRYWANIA REKLAMACJI I DOCHODZENIA ROSZCZEŃ ORAZ ZASADY DOSTĘPU DO TYCH PROCEDUR</h2>\n<h2>PRAWO ODSTĄPIENIA OD UMOWY</h2>\n<h2>POSTANOWIENIA DOTYCZĄCE PRZEDSIĘBIORCÓW</h2>\n<h2>ZASADY KORZYSTANIA Z PRODUKTU - TREŚCI I USŁUGI CYFROWE</h2>\n<h2>OPINIE O PRODUKTACH</h2>\n<h2>POSTANOWIENIA KOŃCOWE</h2>\n<h2>WZÓR FORMULARZA ODSTĄPIENIA OD UMOWY</h2>\n<h2>Ten Regulamin Sklepu Internetowego został przygotowany przez prawników serwisu Prokonsumencki.pl. Sklep Internetowy www.proshop.pl dba o prawa konsumenta. Konsument nie może zrzec się praw przyznanych mu w Ustawie o Prawach Konsumenta. Postanowienia umów mniej korzystne dla konsumenta niż postanowienia Ustawy o Prawach Konsumenta są nieważne, a w ich miejsce stosuje się przepisy Ustawy o Prawach Konsumenta. Dlatego też postanowienia niniejszego Regulaminu nie mają na celu wyłączać ani ograniczać jakichkolwiek praw konsumentów przysługujących im na mocy bezwzględnie wiążących przepisów prawa, a wszelkie ewentualne wątpliwości należy tłumaczyć na korzyść konsumenta. W przypadku ewentualnej niezgodności postanowień niniejszego Regulaminu z powyższymi przepisami, pierwszeństwo mają te przepisy i należy je stosować.</h2>\n<h2></h2>\n<h2>1. POSTANOWIENIA OGÓLNE</h2>\n<h2>1.1. Sklep Internetowy dostępny pod adresem internetowym www.proshop.pl prowadzony jest przez spółkę PROSHOP A/S z siedzibą w Danii (adres siedziby i adres do korespondencji: Slet Moellevej 17, DK-8270 Hoejbjerg); wpisaną do Rejestru Przedsiębiorców Królestwa Danii pod numerem DK18966239 (CVR- nummer); adres poczty elektronicznej: support@proshop.pl oraz numer telefonu kontaktowego: +48 223 978 986.</h2>\n<h2></h2>\n<h2>1.2. Niniejszy Regulamin skierowany jest zarówno do konsumentów, jak i do przedsiębiorców korzystających ze Sklepu Internetowego, chyba że dane postanowienie Regulaminu stanowi inaczej.</h2>\n<h2></h2>\n<h2>1.3. Administratorem danych osobowych przetwarzanych w Sklepie Internetowym w związku z realizacją postanowień niniejszego Regulaminu jest Sprzedawca. Dane osobowe przetwarzane są w celach, przez okres i w oparciu o podstawy i zasady wskazane w polityce prywatności opublikowanej na stronie Sklepu Internetowego. Polityka prywatności zawiera przede wszystkim zasady dotyczące przetwarzania danych osobowych przez Administratora w Sklepie Internetowym, w tym podstawy, cele i okres przetwarzania danych osobowych oraz prawa osób, których dane dotyczą, a także informacje w zakresie stosowania w Sklepie Internetowym plików cookies oraz narzędzi analitycznych. Korzystanie ze Sklepu Internetowego, w tym dokonywanie zakupów jest dobrowolne. Podobnie związane z tym podanie danych osobowych przez korzystającego ze Sklepu Internetowego Usługobiorcę lub Klienta jest dobrowolne, z zastrzeżeniem wyjątków wskazanych w polityce prywatności (zawarcie umowy oraz obowiązki ustawowe Sprzedawcy).</h2>\n<h2></h2>\n<h2>1.4. Definicje:</h2>\n<h2></h2>\n<h2>1.4.1. DZIEŃ ROBOCZY - jeden dzień od poniedziałku do piątku z wyłączeniem dni ustawowo wolnych od pracy.</h2>\n<h2></h2>\n<h2>1.4.2. FORMULARZ REJESTRACJI - formularz dostępny w Sklepie Internetowym umożliwiający utworzenie Konta.</h2>\n<h2></h2>\n<h2>1.4.3. FORMULARZ ZAMÓWIENIA - Usługa Elektroniczna, interaktywny formularz dostępny w Sklepie Internetowym umożliwiający złożenie Zamówienia, w szczególności poprzez dodanie Produktów do elektronicznego koszyka oraz określenie warunków Umowy Sprzedaży, w tym sposobu dostawy i płatności.</h2>\n<h2></h2>\n<h2>1.4.4. KLIENT - (1) osoba fizyczna posiadająca pełną zdolność do czynności prawnych, a w wypadkach przewidzianych przez przepisy powszechnie obowiązujące także osoba fizyczna posiadająca ograniczoną zdolność do czynności prawnych; (2) osoba prawna; albo (3) jednostka organizacyjna nieposiadająca osobowości prawnej, której ustawa przyznaje zdolność prawną - która zawarła lub zamierza zawrzeć Umowę Sprzedaży ze Sprzedawcą.</h2>\n<h2></h2>\n<h2>1.4.5. KODEKS CYWILNY - ustawa Kodeks cywilny z dnia 23 kwietnia 1964 r. (Dz.U. 1964 nr 16, poz. 93 ze zm.).</h2>\n<h2></h2>\n<h2>1.4.6. KONTO - Usługa Elektroniczna, oznaczony indywidualną nazwą (loginem) i hasłem podanym przez Usługobiorcę zbiór zasobów w systemie teleinformatycznym Usługodawcy, w którym gromadzone są dane podane przez Usługobiorcę oraz informacje o złożonych przez niego Zamówieniach w Sklepie Internetowym.</h2>\n<h2></h2>\n<h2>1.4.7. NEWSLETTER - Usługa Elektroniczna, elektroniczna usługa dystrybucyjna świadczona przez Usługodawcę za pośrednictwem poczty elektronicznej e-mail, która umożliwia wszystkim korzystającym z niej Usługobiorcom automatyczne otrzymywanie od Usługodawcy cyklicznych treści kolejnych edycji newslettera zawierającego informacje o Produktach, nowościach i promocjach w Sklepie Internetowym.</h2>\n<h2></h2>\n<h2>1.4.8. POWIADOMIENIE O DOSTĘPNOŚCI - Usługa Elektroniczna, która umożliwia wszystkim korzystającym z niej Usługobiorcom na automatyczne otrzymywanie od Usługodawcy informacji o dostępności Produktu za pośrednictwem poczty elektronicznej e-mail.</h2>\n<h2></h2>\n<h2>1.4.9. PRAWO AUTORSKIE - ustawa o prawie autorskim i prawach pokrewnych z dnia 4 lutego 1994 r. (Dz. U. Nr 24, poz. 83 ze zm.).</h2>\n<h2></h2>\n<h2>1.4.10. PRODUKT - dostępna w Sklepie Internetowym (1) rzecz ruchoma (w tym rzecz ruchoma z elementami cyfrowymi, tj. zawierająca treść cyfrową lub usługę cyfrową lub z nimi połączona w taki sposób, że brak treści cyfrowej lub usługi cyfrowej uniemożliwiłby jej prawidłowe funkcjonowanie), (2) treść cyfrowa, (3) usługa (w tym usługa cyfrowa i inna niż cyfrowa) lub (4) prawo będące przedmiotem Umowy Sprzedaży między Klientem a Sprzedawcą.</h2>\n<h2></h2>\n<h2>1.4.11. PRE-ORDER, PRZEDSPRZEDAŻ - Umowa Sprzedaży Produktu zawierana albo zawarta między Klientem a Sprzedawcą za pośrednictwem Sklepu Internetowego na Produkty, których realizacja rozpocznie się z chwilą ukazania się wszystkich zamówionych Produktów na rynku polskim.</h2>\n<h2></h2>\n<h2>1.4.12. REGULAMIN - niniejszy regulamin Sklepu Internetowego.</h2>\n<h2></h2>\n<h2>1.4.13. SKLEP INTERNETOWY - sklep internetowy Usługodawcy dostępny pod adresem internetowym: www.proshop.pl.</h2>\n<h2></h2>\n<h2>1.4.14. SPRZEDAWCA; USŁUGODAWCA - spółka PROSHOP A/S z siedzibą w Danii (adres siedziby i adres do korespondencji: Slet Moellevej 17, DK-8270 Hoejbjerg); wpisana do Rejestru Przedsiębiorców Królestwa Danii pod numerem DK18966239 (CVR- nummer); adres poczty elektronicznej: support@proshop.pl oraz numer telefonu kontaktowego: +48 223 978 986.</h2>\n<h2></h2>\n<h2>1.4.15. UMOWA SPRZEDAŻY - (1) umowa sprzedaży Produktu (w przypadku rzeczy ruchomych oraz rzeczy ruchomych z elementami cyfrowymi), (2) umowa o dostarczanie Produktu (w przypadku treści cyfrowej lub usługi cyfrowej), (3) umowa o świadczenie lub korzystanie z Produktu (w przypadku usługi innej niż cyfrowa oraz pozostałych Produktów) zawierana albo zawarta między Klientem a Sprzedawcą za pośrednictwem Sklepu Internetowego.</h2>\n<h2></h2>\n<h2>1.4.16. USŁUGA ELEKTRONICZNA - usługa świadczona drogą elektroniczną przez Usługodawcę na rzecz Usługobiorcy za pośrednictwem Sklepu Internetowego.</h2>\n<h2></h2>\n<h2>1.4.17. USŁUGOBIORCA - (1) osoba fizyczna posiadająca pełną zdolność do czynności prawnych, a w wypadkach przewidzianych przez przepisy powszechnie obowiązujące także osoba fizyczna posiadająca ograniczoną zdolność do czynności prawnych; (2) osoba prawna; albo (3) jednostka organizacyjna nieposiadająca osobowości prawnej, której ustawa przyznaje zdolność prawną -korzystająca lub zamierzająca korzystać z Usługi Elektronicznej.</h2>\n<h2></h2>\n<h2>1.4.18. USTAWA O PRAWACH KONSUMENTA - ustawa z dnia 30 maja 2014 r. o prawach konsumenta (Dz.U. 2014 poz. 827 ze zm.).</h2>\n<h2></h2>\n<h2>1.4.19. ZAMÓWIENIE - oświadczenie woli Klienta składane za pomocą Formularza Zamówienia i zmierzające bezpośrednio do zawarcia Umowy Sprzedaży Produktu ze Sprzedawcą.</h2>\n<h2></h2>\n<h2>2. USŁUGI ELEKTRONICZNE W SKLEPIE INTERNETOWYM</h2>\n<h2>2.1. W Sklepie Internetowym dostępne są następujące Usługi Elektroniczne: Konto, Formularz Zamówienia, Newsletter oraz Powiadomienie o Dostępności.</h2>\n<h2></h2>\n<h2>2.1.1. Konto - korzystanie z Konta możliwe jest po wykonaniu łącznie dwóch kolejnych kroków przez Usługobiorcę - (1) wypełnieniu Formularza Rejestracji oraz (2) kliknięciu pola „Utwórz profil”. W Formularzu Rejestracji niezbędne jest podanie przez Usługobiorcę następujących danych Usługobiorcy: imię i nazwisko, adres (ulica, numer domu/mieszkania, kod pocztowy, miejscowość, kraj), adres poczty elektronicznej, numer telefonu kontaktowego oraz hasło. W wypadku Usługobiorców niebędących konsumentami niezbędne jest także podanie nazwy firmy oraz numeru NIP. Usługobiorca może również utworzyć Konto poprzez dokonanie integracji z kontem posiadanym w serwisie Facebook lub Google.</h2>\n<h2></h2>\n<h2>2.1.1.1. Usługa Elektroniczna Konto świadczona jest nieodpłatnie przez czas nieoznaczony. Usługobiorca ma możliwość, w każdej chwili i bez podania przyczyny, usunięcia Konta (rezygnacji z Konta) poprzez wysłanie stosownego żądania do Usługodawcy, w szczególności za pośrednictwem poczty elektronicznej na adres: support@proshop.pl.</h2>\n<h2></h2>\n<h2>2.1.2. Formularz Zamówienia - korzystanie z Formularza Zamówienia rozpoczyna się z momentem dodania przez Klienta pierwszego Produktu do elektronicznego koszyka w Sklepie Internetowym. Złożenie Zamówienia następuje po wykonaniu przez Klienta łącznie dwóch kolejnych kroków - (1) po wypełnieniu Formularza Zamówienia i (2) kliknięciu na stronie Sklepu Internetowego po wypełnieniu Formularza Zamówienia pola „Zapłać” widocznego obok wybranego przez Klienta sposobu płatności - do tego momentu istnieje możliwość samodzielnej modyfikacji wprowadzanych danych (w tym celu należy kierować się wyświetlanymi komunikatami oraz informacjami dostępnymi na stronie Sklepu Internetowego). W Formularzu Zamówienia niezbędne jest podanie przez Klienta następujących danych dotyczących Klienta: imię i nazwisko/nazwa firmy, adres (ulica, numer domu/mieszkania, kod pocztowy, miejscowość, kraj), adres poczty elektronicznej, numer telefonu kontaktowego oraz danych dotyczących Umowy Sprzedaży: Produkt/y, ilość Produktu/ów, miejsce i sposób dostawy Produktu/ów, sposób płatności. W wypadku Klientów niebędących konsumentami niezbędne jest także podanie nazwy firmy oraz numeru NIP.</h2>\n<h2></h2>\n<h2>2.1.2.1. Usługa Elektroniczna Formularz Zamówienia świadczona jest nieodpłatnie oraz ma charakter jednorazowy i ulega zakończeniu z chwilą złożenia Zamówienia za jego pośrednictwem albo z chwilą wcześniejszego zaprzestania składania Zamówienia za jego pośrednictwem przez Usługobiorcę.</h2>\n<h2></h2>\n<h2>2.1.3. Newsletter - korzystanie z Newslettera następuje po podaniu w zakładce „Newsletter” widocznej na stronie Sklepu Internetowego adresu poczty elektronicznej, na który mają być przesyłane kolejne edycje Newslettera i kliknięciu pola akcji. Na Newsletter można się również zapisać poprzez zaznaczenie odpowiedniego checkboxa w trakcie- z chwilą Usługobiorca zostaje zapisany na Newsletter.</h2>\n<h2></h2>\n<h2>2.1.3.1. Usługa Elektroniczna Newsletter świadczona jest nieodpłatnie przez czas nieoznaczony. Usługobiorca ma możliwość, w każdej chwili i bez podania przyczyny, wypisania się z Newslettera (rezygnacji z Newslettera) poprzez wysłanie stosownego żądania do Usługodawcy, w szczególności za pośrednictwem poczty elektronicznej na adres: support@proshop.pl.</h2>\n<h2></h2>\n<h2>2.1.4. Powiadomienie o Dostępności - Usługa Elektroniczna Powiadomienie o Dostępności możliwa jest dla Produktów, które w danej chwili nie mogą stać się przedmiotem Zamówienia z uwagi na brak informacji o ich dostępności. Korzystanie z Powiadomienia o Dostępności następuje po (1) wejściu na stronę niedostępnego Produktu, (2) kliknięciu pola „Powiadom o dostępności”, (3) podaniu we właściwym polu adresu poczty elektronicznej, na który ma być przesłane powiadomienie i (4) kliknięciu pola „Wyślij informacje”. Usługobiorca, który skorzystał z Usługi Elektronicznej, otrzyma automatyczną wiadomość z zaproszeniem do złożenia Zamówienia, gdy Usługodawca potwierdzi dostępność Produktu w magazynie.</h2>\n<h2></h2>\n<h2>2.1.4.1. Usługa Elektroniczna Powiadomienie o Dostępności świadczona jest nieodpłatnie przez czas nieoznaczony. Usługobiorca ma możliwość, w każdej chwili i bez podania przyczyny, wypisania się z Usługi Elektronicznej (rezygnacji) poprzez wysłanie stosownego żądania do Usługodawcy, w szczególności za pośrednictwem poczty elektronicznej na adres: support@proshop.pl.</h2>\n<h2></h2>\n<h2>2.2. Wymagania techniczne niezbędne do współpracy z systemem teleinformatycznym, którym posługuje się Usługodawca: (1) komputer, laptop lub inne urządzenie multimedialne z dostępem do Internetu; (2) dostęp do poczty elektronicznej; (3) przeglądarka internetowa w aktualnej wersji: Mozilla Firefox; Internet Explorer; Opera; Google Chrome; Safari lub Microsoft Edge; (4) zalecana minimalna rozdzielczość ekranu: 1024x768; (5) włączenie w przeglądarce internetowej możliwości zapisu plików Cookies oraz obsługi Javascript.</h2>\n<h2></h2>\n<h2>2.3. Usługobiorca obowiązany jest do korzystania ze Sklepu Internetowego w sposób zgodny z prawem i dobrymi obyczajami mając na uwadze poszanowanie dóbr osobistych oraz praw autorskich i własności intelektualnej Usługodawcy oraz osób trzecich. Usługobiorca obowiązany jest do wprowadzania danych zgodnych ze stanem faktycznym. Usługobiorcę obowiązuje zakaz dostarczania treści o charakterze bezprawnym.</h2>\n<h2></h2>\n<h2>2.4. Tryb postępowania reklamacyjnego dotyczący Usług Elektronicznych wskazany jest w pkt. 6 Regulaminu.</h2>\n<h2></h2>\n<h2>3. WARUNKI ZAWIERANIA UMOWY SPRZEDAŻY</h2>\n<h2>3.1. Zawarcie Umowy Sprzedaży między Klientem a Sprzedawcą następuje po uprzednim złożeniu przez Klienta Zamówienia za pomocą Formularza Zamówień w Sklepie Internetowym zgodnie z pkt. 2.1.2 Regulaminu.</h2>\n<h2></h2>\n<h2>3.2. Cena Produktu uwidoczniona na stronie Sklepu Internetowego podana jest w złotych polskich i zawiera podatki. O łącznej cenie wraz z podatkami Produktu będącego przedmiotem Zamówienia, a także o kosztach dostawy (w tym opłatach za transport, dostarczenie i usługi pocztowe) oraz o innych kosztach, a gdy nie można ustalić wysokości tych opłat - o obowiązku ich uiszczenia, Klient jest informowany na stronach Sklepu Internetowego w trakcie składania Zamówienia, w tym także w chwili wyrażenia przez Klienta woli związania się Umową Sprzedaży.</h2>\n<h2></h2>\n<h2>3.3. Procedura zawarcia Umowy Sprzedaży w Sklepie Internetowym za pomocą Formularza Zamówień</h2>\n<h2></h2>\n<h2>3.3.1. Zawarcie Umowy Sprzedaży między Klientem a Sprzedawcą następuje po uprzednim złożeniu przez Klienta Zamówienia w Sklepie Internetowym zgodnie z pkt. 2.1.2 Regulaminu.</h2>\n<h2></h2>\n<h2>3.3.2. Po złożeniu Zamówienia Sprzedawca niezwłocznie potwierdza jego otrzymanie oraz jednocześnie przyjmuje Zamówienie do realizacji. Potwierdzenie otrzymania Zamówienia i jego przyjęcie do realizacji następuje poprzez przesłanie przez Sprzedawcę Klientowi stosownej wiadomości e-mail na podany w trakcie składania Zamówienia adres poczty elektronicznej Klienta, która zawiera co najmniej oświadczenia Sprzedawcy o otrzymaniu Zamówienia i o jego przyjęciu do realizacji oraz potwierdzenie zawarcia Umowy Sprzedaży. Z chwilą otrzymania przez Klienta powyższej wiadomości e-mail zostaje zawarta Umowa Sprzedaży między Klientem a Sprzedawcą.</h2>\n<h2></h2>\n<h2>3.4. Utrwalenie, zabezpieczenie oraz udostępnienie Klientowi treści zawieranej Umowy Sprzedaży następuje poprzez (1) udostępnienie niniejszego Regulaminu na stronie Sklepu Internetowego oraz (2) przesłanie Klientowi wiadomości e-mail, o której mowa w pkt. 3.3.2. Regulaminu. Treść Umowy Sprzedaży jest dodatkowo utrwalona i zabezpieczona w systemie informatycznym Sklepu Internetowego Sprzedawcy.</h2>\n<h2></h2>\n<h2>4. SPOSOBY I TERMINY PŁATNOŚCI ZA PRODUKT</h2>\n<h2>4.1. Sprzedawca udostępnia Klientowi następujące sposoby płatności z tytułu Umowy Sprzedaży:</h2>\n<h2></h2>\n<h2>4.1.1. Płatność przelewem na rachunek bankowy Sprzedawcy.</h2>\n<h2></h2>\n<h2>4.1.2. Płatności elektroniczne i płatności kartą płatniczą za pośrednictwem serwisu PayU.pl oraz Bambora.com - możliwe aktualne sposoby płatności oraz szczegółowe informacje o podmiotach obsługujących płatności określone są na stronach internetowych: https://www.payu.pl oraz https://bambora.com. Rozliczenia transakcji płatnościami elektronicznymi i kartą płatniczą przeprowadzane są zgodnie z wyborem Klienta za pośrednictwem serwisu PayU.pl lub Bambora.com.</h2>\n<h2></h2>\n<h2>4.1.3. Płatności w systemie ratalnym - przez usługę Raty PayU: płatność odbywa się w całości lub części ze środków pochodzących z kredytu udzielonego przez wybrany przez Klienta podmiot:</h2>\n<h2></h2>\n<h2>4.1.3.1. spółkę ALIOR BANK SPÓŁKA AKCYJNA (spółka ALIOR BANK SPÓŁKA AKCYJNA z siedzibą w Warszawie, ul. Łopuszańska, nr 38D, 02-232 Warszawa, kapitał zakładowy 725 216 080,00 zł opłacony w całości, zarejestrowana w rejestrze przedsiębiorców Krajowego Rejestru Sądowego prowadzonym przez Sąd Rejonowy dla m. st. Warszawy w Warszawie, XIII Wydział Gospodarczy Krajowego Rejestru Sądowego pod numerem KRS: 0000305178, NIP: 1070010731, REGON: 141387142); albo przez:</h2>\n<h2></h2>\n<h2>4.1.3.2. spółkę MBANK SPÓŁKA AKCYJNA z siedzibą w Warszawie (adres siedziby: ul. Senatorska 18, 00-950 Warszawa), zarejestrowaną w rejestrze przedsiębiorców Krajowego Rejestru Sądowego prowadzonym przez Sąd Rejonowy dla m. st. Warszawy w Warszawie, XII Wydział Gospodarczy Krajowego Rejestru Sądowego pod numerem KRS: 0000025237, kapitał zakładowy 168 840 628,00 zł opłacony w całości, NIP: 5260215088, REGON: 001254524).</h2>\n<h2></h2>\n<h2>4.2. Termin płatności:</h2>\n<h2></h2>\n<h2>4.2.1. W przypadku Klienta będącego konsumentem termin na dokonanie płatności wynosi 6 dni kalendarzowych od dnia zawarcia Umowy Sprzedaży.</h2>\n<h2></h2>\n<h2>4.2.2. W przypadku Klienta niebędącego konsumentem termin na dokonanie płatności wynosi 14 dni kalendarzowych od dnia zawarcia Umowy Sprzedaży.</h2>\n<h2></h2>\n<h2>5. KOSZT, SPOSOBY I TERMIN DOSTAWY PRODUKTU</h2>\n<h2>5.1. Dostawa Produktu dostępna jest na terytorium Rzeczypospolitej Polskiej.</h2>\n<h2></h2>\n<h2>5.2. Dostawa Produktu do Klienta jest odpłatna, chyba że Umowa Sprzedaży stanowi inaczej. Koszty dostawy Produktu (w tym opłaty za transport, dostarczenie i usługi pocztowe) są wskazywane Klientowi na stronach Sklepu Internetowego w trakcie składania Zamówienia, w tym także w chwili wyrażenia przez Klienta woli związania się Umową Sprzedaży.</h2>\n<h2></h2>\n<h2>5.3. Sprzedawca udostępnia Klientowi następujące sposoby dostawy Produktu:</h2>\n<h2></h2>\n<h2>5.3.1. Przesyłka kurierska.</h2>\n<h2></h2>\n<h2>5.3.2. W przypadkach indywidualnie ustalonych ze Sprzedawcą - ze względu na niestandardowe rozmiary Zamówienia - możliwa jest dostawa przesyłką paletową.</h2>\n<h2></h2>\n<h2>5.3.3. Przesyłka elektroniczna w przypadku Produktu - treści cyfrowej, która może polegać na przesłaniu Klientowi za pośrednictwem poczty elektronicznej na adres poczty elektronicznej wskazany przez Klienta w trakcie składania Zamówienia Produktu, kodu dostępowego umożliwiającego aktywację Produktu albo unikalnego linku internetowego (adresu URL) umożliwiającego pobranie Produktu. W wypadku udostępnienia unikalnego linku internetowego (adresu URL) umożliwiającego pobranie Produktu, Sprzedawca zapewnia prawidłowość jego działania przez okres 30 dni od dnia udostępnienia, po tym terminie konieczny jest kontakt ze Sprzedawcą celem ponownego udostępnienia. Sprzedawca zaleca w tym okresie pobranie Produktu i jego zapis techniką cyfrową w pamięci komputera.</h2>\n<h2></h2>\n<h2>5.4. Termin dostawy Produktu do Klienta wynosi:</h2>\n<h2></h2>\n<h2>5.4.1. W przypadku Produktów oznaczonych w opisie Produktu jako „dostępne” - od 7 do 14 Dni Roboczych.</h2>\n<h2></h2>\n<h2>5.4.2. W przypadku Produktów oznaczonych w opisie Produktu jako „sprowadzane” - od 20 do 40 Dni Roboczych.</h2>\n<h2></h2>\n<h2>5.4.3. Wskazane w Regulaminie terminy dostawy znajdują zastosowanie, o ile w opisie danego Produktu lub w trakcie składania Zamówienia nie podano krótszego terminu. W przypadku Produktów o różnych terminach dostawy, terminem dostawy jest najdłuższy podany termin, który jednak nie może przekroczyć 40 Dni Roboczych. Początek biegu terminu dostawy Produktu do Klienta liczy się w następujący sposób:</h2>\n<h2></h2>\n<h2>5.4.3.1. W przypadku wyboru przez Klienta sposobu płatności przelewem, płatności elektronicznych lub kartą płatniczą - od dnia uznania rachunku bankowego lub rachunku rozliczeniowego Sprzedawcy.</h2>\n<h2></h2>\n<h2>5.4.3.2. W przypadku wyboru przez Klienta sposobu płatności w systemie ratalnym - od dnia powiadomienia Sprzedawcy przez kredytodawcę o zawarciu z Klientem umowy kredytowej, nie później jednak niż od dnia uznania rachunku bankowego Sprzedawcy środkami z udzielonego Klientowi kredytu.</h2>\n<h2></h2>\n<h2>5.5. W przypadku Produktów oznaczonych jako Przedsprzedaż lub Pre-Order termin dostawy, jak i gotowości Produktu do odbioru przez Klienta nie może rozpocząć biegu wcześniej niż od dnia daty premiery Produktu na rynku polskim, która wskazana jest każdorazowo w opisie Produktu oznaczonego jako Przedsprzedaż lub Pre-Order.</h2>\n<h2></h2>\n<h2>6. PROCEDURA ROZPATRYWANIA REKLAMACJI</h2>\n<h2></h2>\n<h2>6.1. Niniejszy punkt 6. Regulaminu określa procedurę rozpatrywania reklamacji wspólną dla wszystkich reklamacji składanych do Sprzedawcy, w szczególności reklamacji dotyczących Produktów, Umów Sprzedaży, Usług Elektronicznych oraz pozostałych reklamacji związanych z działaniem Sprzedawcy lub Sklepu Internetowego.</h2>\n<h2></h2>\n<h2>6.2. Reklamacja może zostać złożona na przykład:</h2>\n<h2></h2>\n<h2>6.2.1. w formie elektronicznej za pośrednictwem formularza reklamacji dostępnego na stronie Sklepu Internetowego w zakładce „Utwórz zgłoszenie reklamacyjne”;</h2>\n<h2></h2>\n<h2>6.2.2. w formie elektronicznej za pośrednictwem poczty elektronicznej na adres: support@proshop.pl;</h2>\n<h2></h2>\n<h2>6.2.3. pisemnie na adres: Slet Moellevej 17, DK-8270 Hoejbjerg, Dania.</h2>\n<h2></h2>\n<h2>6.3. Przesłanie lub zwrot Produktu w ramach reklamacji może nastąpić na adres: Slet Moellevej 17, DK-8270 Hoejbjerg, Dania.</h2>\n<h2></h2>\n<h2>6.4. Zaleca się podanie w opisie reklamacji: (1) informacji i okoliczności dotyczących przedmiotu reklamacji, w szczególności rodzaju i daty wystąpienia nieprawidłowości lub braku zgodności z umową; (2) żądania sposobu doprowadzenia do zgodności z umową lub oświadczenia o obniżeniu ceny albo odstąpieniu od umowy lub innego roszczenia; oraz (3) danych kontaktowych składającego reklamację - ułatwi to i przyspieszy rozpatrzenie reklamacji. Wymogi podane w zdaniu poprzednim mają formę jedynie zalecenia i nie wpływają na skuteczność reklamacji złożonych z pominięciem zalecanego opisu reklamacji.</h2>\n<h2></h2>\n<h2>6.5. W razie zmiany podanych danych kontaktowych przez składającego reklamację w trakcie rozpatrywania reklamacji zobowiązany jest on do powiadomienia o tym Sprzedawcy.</h2>\n<h2></h2>\n<h2>6.6. Do reklamacji mogą zostać załączone przez składającego reklamację dowody (np. zdjęcia, dokumenty lub Produkt) związane z przedmiotem reklamacji. Sprzedawca może także zwrócić się do składającego reklamację z prośbą o podanie dodatkowych informacji lub przesłanie dowodów (np. zdjęcia), jeżeli ułatwi to i przyspieszy rozpatrzenie reklamacji przez Sprzedawcę.</h2>\n<h2></h2>\n<h2>6.7. Sprzedawca ustosunkuje się do reklamacji niezwłocznie, nie później niż w terminie 14 dni kalendarzowych od dnia jej otrzymania.</h2>\n<h2></h2>\n<h2>6.8. Podstawa i zakres odpowiedzialności ustawowej Sprzedawcy są określone powszechnie obowiązującymi przepisami prawa, w szczególności w Kodeksie Cywilnym, Ustawie o Prawach Konsumenta oraz ustawie o świadczeniu usług drogą elektroniczną z dnia 18 lipca 2002 r. (Dz.U. Nr 144, poz. 1204 ze zm.). Poniżej wskazane są dodatkowe informacje dotyczące przewidzianej przez prawo odpowiedzialności Sprzedawcy za zgodność Produktu z Umową Sprzedaży:</h2>\n<h2></h2>\n<h2>6.8.1. W przypadku reklamacji Produktu - rzeczy ruchomej - zakupionego przez Klienta na podstawie Umowy Sprzedaży zawartej ze Sprzedawcą do dnia 31. grudnia 2022 r. określają przepisy Kodeksu Cywilnego w brzmieniu obowiązującym do dnia 31. grudnia 2022 r., w szczególności art. 556-576 Kodeksu Cywilnego. Przepisy te określają w szczególności podstawę i zakres odpowiedzialności Sprzedawcy względem Klienta, jeżeli sprzedany Produkt ma wadę fizyczną lub prawną (rękojmia). Zgodnie z art. 558 § 1 Kodeksu Cywilnego odpowiedzialność Sprzedawcy z tytułu rękojmi za Produkt zakupiony zgodnie ze zdaniem poprzednim wobec Klienta niebędącego konsumentem zostaje wyłączona.</h2>\n<h2></h2>\n<h2>6.8.2. W przypadku reklamacji Produktu - rzeczy ruchomej (w tym rzeczy ruchomej z elementami cyfrowymi), z wyłączeniem jednak rzeczy ruchomej, która służy wyłącznie jako nośnik treści cyfrowej - zakupionego przez Klienta na podstawie Umowy Sprzedaży zawartej ze Sprzedawcą od dnia 1. stycznia 2023 r. określają przepisy Ustawy o Prawach Konsumenta w brzmieniu obowiązującym od dnia 1. stycznia 2023 r., w szczególności art. 43a - 43g Ustawy o Prawach Konsumenta. Przepisy te określają w szczególności podstawę i zakres odpowiedzialności Sprzedawcy względem konsumenta, w razie braku zgodności Produktu z Umową Sprzedaży.</h2>\n<h2></h2>\n<h2>6.8.3. W przypadku reklamacji Produktu - treści lub usługi cyfrowej lub rzeczy ruchomej, która służy wyłącznie jako nośnik treści cyfrowej - zakupionego przez Klienta na podstawie Umowy Sprzedaży zawartej ze Sprzedawcą od dnia 1. stycznia 2023 r. lub przed tym dniem, jeżeli dostarczanie takiego Produktu miało nastąpić lub nastąpiło po tym dniu określają przepisy Ustawy o Prawach Konsumenta w brzmieniu obowiązującym od dnia 1. stycznia 2023 r., w szczególności art. 43h - 43q Ustawy o Prawach Konsumenta. Przepisy te określają w szczególności podstawę i zakres odpowiedzialności Sprzedawcy względem konsumenta, w razie braku zgodności Produktu z Umową Sprzedaży.</h2>\n<h2></h2>\n<h2>6.9. Poza odpowiedzialnością ustawową na Produkt może zostać udzielona gwarancja - jest to odpowiedzialność umowna (dodatkowa) i można z niej skorzystać, gdy dany Produkt jest objęty gwarancją. Gwarancja może być udzielona przez inny podmiot niż Sprzedawca (np. przez producenta lub dystrybutora). Szczegółowe warunki dotyczące odpowiedzialności na podstawie gwarancji, w tym także dane podmiotu odpowiedzialnego za realizację gwarancji oraz podmiotu uprawnionego do skorzystania z niej są dostępne w opisie gwarancji, np. w karcie gwarancyjnej lub w innym miejscu dotyczącym udzielenia gwarancji. Sprzedawca wskazuje, że w przypadku braku zgodności Produktu z umową Klientowi z mocy prawa przysługują środki ochrony prawnej ze strony i na koszt Sprzedawcy oraz że gwarancja nie ma wpływu na te środki ochrony prawnej.</h2>\n<h2></h2>\n<h2>6.10. Zawarte w punktach 6.8.2. i 6.8.3 Regulaminu postanowienia dotyczące konsumenta stosuje się również do Klienta będącego osobą fizyczną zawierającą umowę bezpośrednio związaną z jej działalnością gospodarczą, gdy z treści tej umowy wynika, że nie posiada ona dla tej osoby charakteru zawodowego, wynikającego w szczególności z przedmiotu wykonywanej przez nią działalności gospodarczej, udostępnionego na podstawie przepisów o Centralnej Ewidencji i Informacji o Działalności Gospodarczej.</h2>\n<h2></h2>\n<h2>7. POZASĄDOWE SPOSOBY ROZPATRYWANIA REKLAMACJI I DOCHODZENIA ROSZCZEŃ ORAZ ZASADY DOSTĘPU DO TYCH PROCEDUR</h2>\n<h2></h2>\n<h2>7.1. Szczegółowe informacje dotyczące możliwości skorzystania przez Klienta będącego konsumentem z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń oraz zasady dostępu do tych procedur dostępne są na stronie internetowej Urzędu Ochrony Konkurencji i Konsumentów pod adresem: https://uokik.gov.pl/pozasadowe_rozwiazywanie_sporow_konsumenckich.php.</h2>\n<h2></h2>\n<h2>7.2. Przy Prezesie Urzędu Ochrony Konkurencji i Konsumentów działa także punkt kontaktowy (telefon: 22 55 60 333, email: kontakt.adr@uokik.gov.pl lub adres pisemny: Pl. Powstańców Warszawy 1, 00-030 Warszawa.), którego zadaniem jest między innymi udzielanie pomocy konsumentom w sprawach dotyczących pozasądowego rozwiązywania sporów konsumenckich.</h2>\n<h2></h2>\n<h2>7.3. Konsument posiada następujące przykładowe możliwości skorzystania z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń: (1) wniosek o rozstrzygnięcie sporu do stałego polubownego sądu konsumenckiego (więcej informacji na stronie: http://www.spsk.wiih.org.pl/); (2) wniosek w sprawie pozasądowego rozwiązania sporu do wojewódzkiego inspektora Inspekcji Handlowej (więcej informacji na stronie inspektora właściwego ze względu na miejsce wykonywania działalności gospodarczej przez Sprzedawcę); oraz (3) pomoc powiatowego (miejskiego) rzecznika konsumentów lub organizacji społecznej, do której zadań statutowych należy ochrona konsumentów (m. in. Federacja Konsumentów, Stowarzyszenie Konsumentów Polskich). Porady udzielane są między innymi mailowo pod adresem porady@dlakonsumentow.pl oraz pod numerem infolinii konsumenckiej 801 440 220 (infolinia czynna w Dni Robocze, w godzinach 8:00-18:00, opłata za połączenie wg taryfy operatora).</h2>\n<h2></h2>\n<h2>7.4. Pod adresem http://ec.europa.eu/consumers/odr dostępna jest platforma internetowego systemu rozstrzygania sporów pomiędzy konsumentami i przedsiębiorcami na szczeblu unijnym (platforma ODR). Platforma ODR stanowi interaktywną i wielojęzyczną stronę internetową z punktem kompleksowej obsługi dla konsumentów i przedsiębiorców dążących do pozasądowego rozstrzygnięcia sporu dotyczącego zobowiązań umownych wynikających z internetowej umowy sprzedaży lub umowy o świadczenie usług (więcej informacji na stronie samej platformy lub pod adresem internetowym Urzędu Ochrony Konkurencji i Konsumentów: https://uokik.gov.pl/spory_konsumenckie_faq_platforma_odr.php).</h2>\n<h2></h2>\n<h2>8. PRAWO ODSTĄPIENIA OD UMOWY</h2>\n<h2></h2>\n<h2>8.1. Konsument, który zawarł umowę na odległość, może w terminie 14 dni kalendarzowych odstąpić od niej bez podawania przyczyny i bez ponoszenia kosztów, z wyjątkiem kosztów określonych w pkt 8.8 Regulaminu. Do zachowania terminu wystarczy wysłanie oświadczenia przed jego upływem. Oświadczenie o odstąpieniu od umowy może zostać złożone na przykład:</h2>\n<h2></h2>\n<h2>a. w formie elektronicznej za pośrednictwem formularza zwrotów dostępnego na stronie Sklepu Internetowego w zakładce „Utwórz zgłoszenie zwrotu (odstąpienia)”;</h2>\n<h2></h2>\n<h2>b. w formie elektronicznej za pośrednictwem poczty elektronicznej na adres: support@proshop.pl;</h2>\n<h2></h2>\n<h2>c. pisemnie na adres: Slet Moellevej 17, DK-8270 Hoejbjerg, Dania.</h2>\n<h2></h2>\n<h2>8.2. Zwrot Produktu - rzeczy ruchomych (w tym rzeczy ruchomych z elementami cyfrowymi) w ramach odstąpienia od umowy może nastąpić na adres: Slet Moellevej 17, DK-8270 Hoejbjerg, Dania.</h2>\n<h2></h2>\n<h2>8.3. Przykładowy wzór formularza odstąpienia od umowy zawarty jest w załączniku nr 2 do Ustawy o Prawach Konsumenta oraz dodatkowo dostępny jest w pkt 13 Regulaminu. Konsument może skorzystać z wzoru formularza, jednak nie jest to obowiązkowe.</h2>\n<h2></h2>\n<h2>8.4. Bieg terminu do odstąpienia od umowy rozpoczyna się:</h2>\n<h2></h2>\n<h2>8.4.1. dla umowy, w wykonaniu której Sprzedawca wydaje Produkt, będąc zobowiązany do przeniesienia jego własności (np. Umowa Sprzedaży) - od objęcia Produktu w posiadanie przez konsumenta lub wskazaną przez niego osobę trzecią inną niż przewoźnik, a w przypadku umowy, która: (1) obejmuje wiele Produktów, które są dostarczane osobno, partiami lub w częściach - od objęcia w posiadanie ostatniego Produktu, partii lub części albo (2) polega na regularnym dostarczaniu Produktów przez czas oznaczony - od objęcia w posiadanie pierwszego z Produktów;</h2>\n<h2></h2>\n<h2>8.4.2. dla pozostałych umów - od dnia zawarcia umowy.</h2>\n<h2></h2>\n<h2>8.5. W przypadku odstąpienia od umowy zawartej na odległość umowę uważa się za niezawartą.</h2>\n<h2></h2>\n<h2>8.6. Produkty - rzeczy ruchome, w tym rzeczy ruchome z elementami cyfrowymi:</h2>\n<h2></h2>\n<h2>8.6.1. Sprzedawca ma obowiązek niezwłocznie, nie później niż w terminie 14 dni kalendarzowych od dnia otrzymania oświadczenia konsumenta o odstąpieniu od umowy, zwrócić konsumentowi wszystkie dokonane przez niego płatności, w tym koszty dostarczenia Produktu - rzeczy ruchomej, w tym rzeczy ruchomej z elementami cyfrowymi (z wyjątkiem dodatkowych kosztów wynikających z wybranego przez konsumenta sposobu dostarczenia innego niż najtańszy zwykły sposób dostawy dostępny w Sklepie Internetowym). Sprzedawca dokonuje zwrotu płatności przy użyciu takiego samego sposobu płatności, jakiego użył konsument, chyba że konsument wyraźnie zgodził się na inny sposób zwrotu, który nie wiąże się dla niego z żadnymi kosztami. W przypadku Produktów - rzeczy ruchomych (w tym rzeczy ruchomych z elementami cyfrowymi) - jeżeli Sprzedawca nie zaproponował, że sam odbierze Produkt od konsumenta, może wstrzymać się ze zwrotem płatności otrzymanych od konsumenta do chwili otrzymania Produktu z powrotem lub dostarczenia przez konsumenta dowodu jego odesłania, w zależności od tego, które zdarzenie nastąpi wcześniej.</h2>\n<h2></h2>\n<h2>8.6.2. W przypadku Produktów - rzeczy ruchomych (w tym rzeczy ruchomych z elementami cyfrowymi) - konsument ma obowiązek niezwłocznie, nie później niż w terminie 14 dni kalendarzowych od dnia, w którym odstąpił od umowy, zwrócić Produkt Sprzedawcy lub przekazać go osobie upoważnionej przez Sprzedawcę do odbioru, chyba że Sprzedawca zaproponował, że sam odbierze Produkt. Do zachowania terminu wystarczy odesłanie Produktu przed jego upływem.</h2>\n<h2></h2>\n<h2>8.6.3. Konsument ponosi odpowiedzialność za zmniejszenie wartości Produktu - rzeczy ruchomej (w tym rzeczy ruchomej z elementami cyfrowymi) - będące wynikiem korzystania z niego w sposób wykraczający poza konieczny do stwierdzenia charakteru, cech i funkcjonowania Produktu.</h2>\n<h2></h2>\n<h2>8.7. Produkty - treści cyfrowe lub usługi cyfrowe:</h2>\n<h2></h2>\n<h2>8.7.1. W przypadku odstąpienia od umowy o dostarczanie Produktu - treści cyfrowej lub usługi cyfrowej - Sprzedawca od dnia otrzymania oświadczenia konsumenta o odstąpieniu od umowy nie może wykorzystywać treści innych niż dane osobowe dostarczone lub wytworzone przez konsumenta w trakcie korzystania z Produktu - treści cyfrowych lub usługi cyfrowej - dostarczonych przez Sprzedawcę, z wyjątkiem treści, które: (1) są użyteczne wyłącznie w związku z treścią cyfrową lub usługą cyfrową, które stanowiły przedmiot umowy; (2) dotyczą wyłącznie aktywności konsumenta w trakcie korzystania z treści cyfrowych lub usługi cyfrowej dostarczonych przez Sprzedawcę; (3) zostały połączone przez przedsiębiorcę z innymi danymi i nie mogą zostać z nich wydzielone lub mogą zostać wydzielone jedynie przy nakładzie niewspółmiernych wysiłków; (4) zostały wytworzone przez konsumenta wspólnie z innymi konsumentami, którzy nadal mogą z nich korzystać. Z wyjątkiem przypadków, o których mowa wyżej w pkt (1)-(3,) Sprzedawca na żądanie konsumenta udostępnia mu treści inne niż dane osobowe, które zostały dostarczone lub wytworzone przez konsumenta w trakcie korzystania z treści cyfrowych lub usługi cyfrowej dostarczonych przez Sprzedawcę. W przypadku odstąpienia od umowy Sprzedawca może uniemożliwić konsumentowi dalsze korzystanie z treści cyfrowych lub usługi cyfrowej, w szczególności przez uniemożliwienie konsumentowi dostępu do treści cyfrowych lub usługi cyfrowej lub zablokowanie konta użytkownika, co nie ma wpływu na uprawnienia konsumenta, o których mowa w zdaniu poprzednim. Konsument ma prawo odzyskać treści cyfrowe od Sprzedawcy nieodpłatnie, bez przeszkód ze strony Sprzedawcy, w rozsądnym terminie i powszechnie używanym formacie przeznaczonym do odczytu maszynowego.</h2>\n<h2></h2>\n<h2>8.7.2. W przypadku odstąpienia od umowy o dostarczanie Produktu - treści cyfrowej lub usługi cyfrowej, konsument jest zobowiązany zaprzestać korzystania z tej treści cyfrowej lub usługi cyfrowej i udostępniania ich osobom trzecim.</h2>\n<h2></h2>\n<h2>8.8. Możliwe koszty związane z odstąpieniem przez konsumenta od umowy, które obowiązany jest ponieść konsument:</h2>\n<h2></h2>\n<h2>8.8.1. W przypadku Produktów - rzeczy ruchomych (w tym rzeczy ruchomych z elementami cyfrowymi) - jeżeli konsument wybrał sposób dostawy Produktu inny niż najtańszy zwykły sposób dostawy dostępny w Sklepie Internetowym, Sprzedawca nie jest zobowiązany do zwrotu konsumentowi poniesionych przez niego dodatkowych kosztów.</h2>\n<h2></h2>\n<h2>8.8.2. W przypadku Produktów - rzeczy ruchomych (w tym rzeczy ruchomych z elementami cyfrowymi) konsument ponosi bezpośrednie koszty zwrotu Produktu.</h2>\n<h2></h2>\n<h2>8.8.3. W przypadku Produktu będącego usługą, której wykonywanie - na wyraźne żądanie konsumenta - rozpoczęło się przed upływem terminu do odstąpienia od umowy, konsument, który wykonuje prawo odstąpienia od umowy po zgłoszeniu takiego żądania, ma obowiązek zapłaty za świadczenia spełnione do chwili odstąpienia od umowy. Kwotę zapłaty oblicza się proporcjonalnie do zakresu spełnionego świadczenia, z uwzględnieniem uzgodnionej w umowie ceny lub wynagrodzenia. Jeżeli cena lub wynagrodzenie są nadmierne, podstawą obliczenia tej kwoty jest wartość rynkowa spełnionego świadczenia.</h2>\n<h2></h2>\n<h2>8.9. Prawo odstąpienia od umowy zawartej na odległość nie przysługuje konsumentowi w odniesieniu do umów:</h2>\n<h2></h2>\n<h2>8.9.1. (1) o świadczenie usług, za które konsument jest zobowiązany do zapłaty ceny, jeżeli Sprzedawca wykonał w pełni usługę za wyraźną i uprzednią zgodą konsumenta, który został poinformowany przed rozpoczęciem świadczenia, że po spełnieniu świadczenia przez Sprzedawcę utraci prawo odstąpienia od umowy, i przyjął to do wiadomości; (2) w której cena lub wynagrodzenie zależy od wahań na rynku finansowym, nad którymi Sprzedawca nie sprawuje kontroli, i które mogą wystąpić przed upływem terminu do odstąpienia od umowy; (3) w której przedmiotem świadczenia jest Produkt - rzecz ruchoma (w tym rzecz ruchoma z elementami cyfrowymi) - nieprefabrykowany, wyprodukowany według specyfikacji konsumenta lub służący zaspokojeniu jego zindywidualizowanych potrzeb; (4) w której przedmiotem świadczenia jest Produkt - rzecz ruchoma (w tym rzecz ruchoma z elementami cyfrowymi) - ulegający szybkiemu zepsuciu lub mająca krótki termin przydatności do użycia; (5) w której przedmiotem świadczenia jest Produkt - rzecz ruchoma (w tym rzecz ruchoma z elementami cyfrowymi) - dostarczany w zapieczętowanym opakowaniu, którego po otwarciu opakowania nie można zwrócić ze względu na ochronę zdrowia lub ze względów higienicznych, jeżeli opakowanie zostało otwarte po dostarczeniu; (6) w której przedmiotem świadczenia są Produkty - rzeczy ruchome (w tym rzeczy ruchome z elementami cyfrowymi) -, które po dostarczeniu, ze względu na swój charakter, zostają nierozłącznie połączone z innymi rzeczami ruchomymi, w tym rzeczami ruchomymi z elementami cyfrowymi; (7) w której przedmiotem świadczenia są napoje alkoholowe, których cena została uzgodniona przy zawarciu Umowy Sprzedaży, a których dostarczenie może nastąpić dopiero po upływie 30 dni i których wartość zależy od wahań na rynku, nad którymi Sprzedawca nie ma kontroli; (8) w której konsument wyraźnie żądał, aby Sprzedawca do niego przyjechał w celu dokonania pilnej naprawy lub konserwacji; jeżeli Sprzedawca świadczy dodatkowo inne usługi niż te, których wykonania konsument żądał, lub dostarcza Produkty - rzeczy ruchome (w tym rzeczy ruchome z elementami cyfrowymi) -,inne niż części zamienne niezbędne do wykonania naprawy lub konserwacji, prawo odstąpienia od umowy przysługuje konsumentowi w odniesieniu do dodatkowych usług lub Produktów; (9) w której przedmiotem świadczenia są nagrania dźwiękowe lub wizualne albo programy komputerowe dostarczane w zapieczętowanym opakowaniu, jeżeli opakowanie zostało otwarte po dostarczeniu; (10) o dostarczanie dzienników, periodyków lub czasopism, z wyjątkiem umowy o prenumeratę; (11) zawartej w drodze aukcji publicznej; (12) o świadczenie usług w zakresie zakwaterowania, innych niż do celów mieszkalnych, przewozu towarów, najmu samochodów, gastronomii, usług związanych z wypoczynkiem, wydarzeniami rozrywkowymi, sportowymi lub kulturalnymi, jeżeli w umowie oznaczono dzień lub okres świadczenia usługi; (13) o dostarczanie treści cyfrowych niedostarczanych na nośniku materialnym, za które konsument jest zobowiązany do zapłaty ceny, jeżeli Sprzedawca rozpoczął świadczenie za wyraźną i uprzednią zgodą konsumenta, który został poinformowany przed rozpoczęciem świadczenia, że po spełnieniu świadczenia przez Sprzedawcę utraci prawo odstąpienia od umowy, i przyjął to do wiadomości, a Sprzedawca przekazał konsumentowi potwierdzenie, o którym mowa w art. 15 ust. 1 i 2 albo art. 21 ust. 1 Ustawy o Prawach Konsumenta; (14) o świadczenie usług, za które konsument jest zobowiązany do zapłaty ceny w przypadku których konsument wyraźnie zażądał od Sprzedawcy, aby przyjechał do niego w celu dokonania naprawy, a usługa została już w pełni wykonana za wyraźną i uprzednią zgodą konsumenta.</h2>\n<h2></h2>\n<h2>8.10. Zawarte w niniejszym punkcie 8. Regulaminu postanowienia dotyczące konsumenta stosuje się od dnia 1 stycznia 2021 r. i dla umów zawartych od tego dnia również do Usługobiorcy lub Klienta będącego osobą fizyczną zawierającą umowę bezpośrednio związaną z jej działalnością gospodarczą, gdy z treści tej umowy wynika, że nie posiada ona dla tej osoby charakteru zawodowego, wynikającego w szczególności z przedmiotu wykonywanej przez nią działalności gospodarczej, udostępnionego na podstawie przepisów o Centralnej Ewidencji i Informacji o Działalności Gospodarczej.</h2>\n<h2></h2>\n<h2>9. POSTANOWIENIA DOTYCZĄCE PRZEDSIĘBIORCÓW</h2>\n<h2></h2>\n<h2>9.1. Niniejszy punkt 9. Regulaminu oraz wszystkie postanowienia w nim zawarte są skierowane i tym samym wiążą wyłącznie Klienta lub Usługobiorcę niebędącego konsumentem. Ponadto od dnia 1 stycznia 2021 r. i dla umów zawartych od tego dnia niniejszy punkt Regulaminu oraz wszystkie postanowienia w nim zawarte nie są skierowane i tym samym nie wiążą Klienta lub Usługobiorcy będącego osobą fizyczną zawierającą umowę bezpośrednio związaną z jej działalnością gospodarczą, gdy z treści tej umowy wynika, że nie posiada ona dla tej osoby charakteru zawodowego, wynikającego w szczególności z przedmiotu wykonywanej przez nią działalności gospodarczej, udostępnionego na podstawie przepisów o Centralnej Ewidencji i Informacji o Działalności Gospodarczej, chyba że zastosowanie do tych osób postanowień zawartych w tym punkcie Regulaminu nie jest niedozwolone.</h2>\n<h2></h2>\n<h2>9.2. Sprzedawcy przysługuje prawo odstąpienia od Umowy Sprzedaży w terminie 14 dni kalendarzowych od dnia jej zawarcia. Odstąpienie od Umowy Sprzedaży w tym wypadku może nastąpić bez podania przyczyny i nie rodzi po stronie Klienta żadnych roszczeń w stosunku do Sprzedawcy.</h2>\n<h2></h2>\n<h2>9.3. Odpowiedzialność Sprzedawcy z tytułu rękojmi za Produkt lub braku zgodności Produktu z Umową Sprzedaży zostaje wyłączona.</h2>\n<h2></h2>\n<h2>9.4. Sprzedawca ustosunkuje się do reklamacji w terminie 30 dni kalendarzowych od dnia jej otrzymania.</h2>\n<h2></h2>\n<h2>9.5. Sprzedawca ma prawo ograniczyć dostępne sposoby płatności, w tym także wymagać dokonania przedpłaty w całości albo części i to niezależnie od wybranego przez Klienta sposobu płatności oraz faktu zawarcia Umowy Sprzedaży.</h2>\n<h2></h2>\n<h2>9.6. Usługodawca może wypowiedzieć umowę o świadczenie Usługi Elektronicznej ze skutkiem natychmiastowym i bez wskazywania przyczyn poprzez przesłanie Usługobiorcy stosownego oświadczenia.</h2>\n<h2></h2>\n<h2>9.7. Odpowiedzialność Usługodawcy/Sprzedawcy w stosunku do Usługobiorcy/Klienta, bez względu na jej podstawę prawną, jest ograniczona - zarówno w ramach pojedynczego roszczenia, jak również za wszelkie roszczenia w sumie - do wysokości zapłaconej ceny oraz kosztów dostawy z tytułu Umowy Sprzedaży, nie więcej jednak niż do kwoty jednego tysiąca złotych. Ograniczenie kwotowe, o którym mowa w zdaniu poprzednim, ma zastosowanie do wszelkich roszczeń kierowanych przez Usługobiorcę/Klienta w stosunku do Usługodawcy/Sprzedawcy, w tym także w przypadku braku zawarcia Umowy Sprzedaży lub niezwiązanych z Umową Sprzedaży. Usługodawca/Sprzedawca ponosi odpowiedzialność w stosunku do Usługobiorcy/Klienta tylko za typowe szkody przewidywalne w momencie zawarcia umowy i nie ponosi odpowiedzialności z tytułu utraconych korzyści. Sprzedawca nie ponosi także odpowiedzialności za opóźnienie w przewozie przesyłki.</h2>\n<h2></h2>\n<h2>9.8. Wszelkie spory powstałe pomiędzy Sprzedawcą/Usługodawcą a Klientem/Usługobiorcą zostają poddane sądowi właściwemu ze względu na siedzibę Sprzedawcy/Usługodawcy.</h2>\n<h2></h2>\n<h2>10. ZASADY KORZYSTANIA Z PRODUKTU - TREŚCI I USŁUGI CYFROWE</h2>\n<h2></h2>\n<h2>10.1. Niniejszy punkt 10. Regulaminu określa domyślne zasady korzystania z Produktów - treści i usług cyfrowych dostępnych w Sklepie Internetowym. Zasady te mają zastosowanie w razie braku ustalenia dla danego Produktu indywidualnych warunków korzystania z Produktu lub w zakresie nieuregulowanym indywidualnymi warunkami (np. w przypadku licencji udzielanej przez producenta danego Produktu zastosowanie będzie miała licencja producenta).</h2>\n<h2></h2>\n<h2>10.2. Prawa do Produktu, w tym także prawa autorskie w przypadku Produktów stanowiących utwór w rozumieniu Prawa Autorskiego, przysługują Sprzedawcy bądź innym uprawnionym podmiotom trzecim.</h2>\n<h2></h2>\n<h2>10.3. Klient na podstawie zawartej Umowy Sprzedaży jest uprawniony korzystać z Produktu w sposób oraz w zakresie niezbędnym do korzystania z niego dla celów określonych Umową Sprzedaży, a w razie braku ich określenia dla celów, w których zazwyczaj korzysta się z Produktu tego rodzaju, z uwzględnieniem obowiązujących przepisów prawa, norm technicznych lub dobrych praktyk.</h2>\n<h2></h2>\n<h2>10.4. Korzystanie przez Klienta z Produktu możliwe jest wyłącznie dla użytku własnego Klienta, w tym w ramach prowadzonej przez niego działalności gospodarczej, chyba że Umowa Sprzedaży stanowi inaczej. Z zastrzeżeniem wyjątków przewidzianych przez przepisy powszechnie obowiązujące oraz odmiennych postanowień Umowy Sprzedaży: (1) Klient nie jest uprawniony do udostępniania Produktu osobom trzecim; (2) Klient nie jest uprawniony do wykorzystywania Produktu w celach zarobkowych, w tym do wprowadzania Produktu do obrotu; (3) Klient nie jest uprawniony do przenoszenia, sublicencjonowania ani upoważniania innych osób do korzystania z Produktu; (4) Klient nie jest uprawniony do kopiowania, powielania, modyfikowania, adaptowania, tłumaczenia, odkodowywania, dekompilowania, dezasemblowania lub jakichkolwiek innych prób ingerencji w Produkt, chyba że jest to niezbędne do zapewnienia prawidłowego korzystania z Produktu zgodnie z Umową Sprzedaży.</h2>\n<h2></h2>\n<h2>10.5. Korzystanie przez Klienta z Produktu możliwe jest przez czas określony Umową Sprzedaży.</h2>\n<h2></h2>\n<h2>10.6. Dostęp do Produktu udzielany jest poprzez przesłanie Produktu - treści cyfrowych, kodu umożliwiającego aktywację Produktu - treści cyfrowych lub linku (adresu URL) umożliwiającego ich odtworzenie na adres poczty elektronicznej podany przez Klienta w trakcie składania Zamówienia.</h2>\n<h2></h2>\n<h2>11. OPINIE O PRODUKTACH</h2>\n<h2></h2>\n<h2>11.1. Sprzedawca umożliwia swoim Klientom wystawianie i dostęp do opinii o Produktach oraz o Sklepie Internetowym na zasadach wskazanych w niniejszym punkcie Regulaminu.</h2>\n<h2></h2>\n<h2>11.2. Wystawienie opinii przez Klienta możliwe jest po skorzystaniu z formularza umożliwiającego dodanie opinii o Produkcie lub Sklepie Internetowym. Formularz ten może być udostępniony bezpośrednio na stronie Sklepu Internetowego (w tym także za pomocą zewnętrznego widgetu) lub może zostać udostępniony za pomocą indywidualnego linku otrzymanego przez Klienta po zakupie na podany przez niego adres poczty elektronicznej. Dodając opinię, Usługobiorca może również dodać ocenę graficzną lub zdjęcie Produktu - jeżeli taka opcja jest dostępna w formularzu opinii.</h2>\n<h2></h2>\n<h2>11.3. Opinia o Produkcie może być wystawiona tylko do faktycznie zakupionych Produktów w Sklepie Internetowym Sprzedawcy oraz przez Klienta, który dokonał zakupu opiniowanego Produktu. Zabronione jest zawieranie fikcyjnych lub pozornych Umów Sprzedaży w celu wystawienia opinii o Produkcie. Opinia o Sklepie Internetowym może być wystawiona przez osobę będącą Klientem Sklepu Internetowego.</h2>\n<h2></h2>\n<h2>11.4. Dodawanie opinii przez Klientów nie może być wykorzystywane do działań bezprawnych, w szczególności do działań stanowiących czyn nieuczciwej konkurencji, czy też działań naruszających dobra osobiste, prawa własności intelektualnej lub inne prawa Sprzedawcy lub osób trzecich. Klient dodając opinię obowiązany jest do działania zgodnego z prawem, niniejszym Regulaminem i dobrymi obyczajami.</h2>\n<h2></h2>\n<h2>11.5. Opinie mogą być udostępniane bezpośrednio na stronie Sklepu Internetowego (np. przy danym Produkcie) lub w zewnętrznym serwisie zbierającym opinie, z którym współpracuje Sprzedawca i do którego odsyła na stronie Sklepu Internetowego (w tym także za pomocą zewnętrznego widgetu umieszczonego na stronie Sklepu Internetowego).</h2>\n<h2></h2>\n<h2>11.6. Sprzedawca zapewnia aby publikowane opinie o Produktach pochodziły od jego Klientów, którzy zakupili dany Produkt. W tym celu Sprzedawca podejmuje następujące działania, aby sprawdzić, czy opinie pochodzą od jego Klientów:</h2>\n<h2></h2>\n<h2>11.6.1. Opublikowanie opinii wystawianej za pomocą formularza dostępnego bezpośrednio na stronie Sklepu Internetowego wymaga wcześniejszej weryfikacji przez Sprzedawcę. Weryfikacja polega na sprawdzeniu zgodności opinii z Regulaminem, w szczególności na sprawdzeniu, czy osoba opiniująca jest Klientem Sklepu Internetowego - w tym wypadku Sprzedawca sprawdza, czy osoba ta dokonała zakupu w Sklepie Internetowym, a w przypadku opinii o Produkcie sprawdza dodatkowo, czy zakupiła opiniowany Produkt. Weryfikacja następuje bez zbędnej zwłoki.</h2>\n<h2></h2>\n<h2>11.6.2. Sprzedawca wysyła swoim Klientom (w tym także za pomocą zewnętrznego serwisu zbierającego opinie, z którym współpracuje) indywidualny link na podany przez niego przy zakupie adres poczty elektronicznej - w ten sposób dostęp do formularza opinii otrzymuje wyłącznie Klient, który dokonał zakupu Produktu w Sklepie Internetowym.</h2>\n<h2></h2>\n<h2>11.6.3. W razie wątpliwości Sprzedawcy lub zastrzeżeń kierowanych do Sprzedawcy przez innych Klientów lub osoby trzecie, czy dana opinia pochodzi od Klienta lub czy dany Klient kupił dany Produkt, Sprzedawca zastrzega sobie prawo skontaktowania się z autorem opinii celem wyjaśnienia i potwierdzenia, że faktycznie jest Klientem Sklepu Internetowego lub dokonał zakupu opiniowanego Produktu.</h2>\n<h2></h2>\n<h2>11.7. Wszelkie uwagi, odwołania od weryfikacji opinii, czy też zastrzeżenia czy dana opinia pochodzi od Klienta lub czy dany Klient kupił dany Produkt mogą być zgłaszane w trybie analogicznym do procedury reklamacyjnej wskazanej w punkcie 6. Regulaminu.</h2>\n<h2></h2>\n<h2>11.8. Sprzedawca nie zamieszcza ani nie zleca zamieszczania innej osobie nieprawdziwych opinii lub rekomendacji Klientów oraz nie zniekształca opinii lub rekomendacji Klientów w celu promowania swoich Produktów. Sprzedawca udostępnia opnie zarówno pozytywne, jak i negatywne. Sprzedawca nie udostępnia sponsorowanych opinii.</h2>\n<h2></h2>\n<h2>12. POSTANOWIENIA KOŃCOWE</h2>\n<h2></h2>\n<h2>12.1. Umowy zawierane poprzez Sklep Internetowy zawierane są w języku polskim.</h2>\n<h2></h2>\n<h2>12.2. Zmiana Regulaminu:</h2>\n<h2></h2>\n<h2>12.2.1. Usługodawca zastrzega sobie prawo do dokonywania zmian Regulaminu z ważnych przyczyn to jest: zmiany przepisów prawa; zmiany sposobów płatności i dostaw - w zakresie, w jakim te zmiany wpływają na realizację postanowień niniejszego Regulaminu.</h2>\n<h2></h2>\n<h2>12.2.2. W przypadku zawarcia na podstawie niniejszego Regulaminu umów o charakterze ciągłym (np. świadczenie Usługi Elektronicznej - Konto) zmieniony Regulamin wiąże Usługobiorcę, jeżeli zostały zachowane wymagania określone w art. 384 oraz 384[1] Kodeksu Cywilnego, to jest Usługobiorca został prawidłowo powiadomiony o zmianach i nie wypowiedział umowy w terminie 15 dni kalendarzowych od dnia powiadomienia. W wypadku gdyby zmiana Regulaminu skutkowała wprowadzeniem jakichkolwiek nowych opłat lub podwyższeniem obecnych Usługobiorca ma prawo odstąpienia od umowy.</h2>\n<h2></h2>\n<h2>12.2.3. W przypadku zawarcia na podstawie niniejszego Regulaminu umów o innym charakterze niż umowy ciągłe (np. Umowa Sprzedaży) zmiany Regulaminu nie będą w żaden sposób naruszać praw nabytych Usługobiorców/Klientów przed dniem wejścia w życie zmian Regulaminu, w szczególności zmiany Regulaminu nie będą miały wpływu na już składane lub złożone Zamówienia oraz zawarte, realizowane lub wykonane Umowy Sprzedaży.</h2>\n<h2></h2>\n<h2>12.3. W sprawach nieuregulowanych w niniejszym Regulaminie mają zastosowanie powszechnie obowiązujące przepisy prawa polskiego, w szczególności: Kodeksu Cywilnego; ustawy o świadczeniu usług drogą elektroniczną z dnia 18 lipca 2002 r. (Dz.U. 2002 nr 144, poz. 1204 ze zm.); Ustawy o Prawach Konsumenta; oraz inne właściwe przepisy powszechnie obowiązującego prawa.</h2>\n<h2></h2>\n<h2>13. WZÓR FORMULARZA ODSTĄPIENIA OD UMOWY</h2>\n<h2></h2>\n<h2>(ZAŁĄCZNIK NUMER 2 DO USTAWY O PRAWACH KONSUMENTA)</h2>\n<h2></h2>\n<h2>Wzór formularza odstąpienia od umowy</h2>\n<h2></h2>\n<h2>(formularz ten należy wypełnić i odesłać tylko w przypadku chęci odstąpienia od umowy)</h2>\n<h2></h2>\n<h2>- Adresat:</h2>\n<h2></h2>\n<h2>PROSHOP A/S</h2>\n<h2></h2>\n<h2>Slet Moellevej 17, DK-8270 Hoejbjerg</h2>\n<h2></h2>\n<h2>proshop.pl</h2>\n<h2></h2>\n<h2>support@proshop.pl</h2>\n<h2></h2>\n<h2>- Ja/My(*) niniejszym informuję/informujemy(*) o moim/naszym odstąpieniu od umowy sprzedaży następujących towarów(*) umowy dostawy następujących towarów(*) umowy o dzieło polegającej na wykonaniu następujących towarów(*)/o świadczenie następującej usługi(*)</h2>\n<h2></h2>\n<h2>- Data zawarcia umowy(*)/odbioru(*)</h2>\n<h2></h2>\n<h2>- Imię i nazwisko konsumenta(-ów)</h2>\n<h2></h2>\n<h2>- Adres konsumenta(-ów)</h2>\n<h2></h2>\n<h2>- Podpis konsumenta(-ów) (tylko jeżeli formularz jest przesyłany w wersji papierowej)</h2>\n<h2></h2>\n<h2>- Data</h2>\n<h2></h2>\n<h2>(*) Niepotrzebne skreślić.</h2>\n<h2></h2>\n<h2>---</h2>\n<h2></h2>\n<h2>ZASADY DOTYCZĄCE KARTY PODARUNKOWEJ</h2>\n<h2></h2>\n<h2>Karta podarunkowa</h2>\n<h2></h2>\n<h2>Karta podarunkowa Proshop a/s jest wydawana elektronicznie i musi być zrealizowana na naszej stronie internetowej.</h2>\n<h2>Realizacja odbywa się w trakcie składania zamówienia w kroku 3. Karta podarunkowa może być wystawiona na kwotę 50-2000 PLN.</h2>\n<h2>Jeżeli karta podarunkowa zostanie wykorzystana do zakupu towarów o wartości mniejszej niż zdeponowana kwota, pozostała wartość pozostanie na karcie podarunkowej.</h2>\n<h2>Karta podarunkowa Proshop a/s jest ważna przez 2 lata od daty jej wystawienia i nie może być ponownie opłacona.</h2>\n<h2>Uszkodzona, wykorzystana, skradziona lub zagubiona karta podarunkowa nie podlega wymianie.</h2>\n<h2>Karty podarunkowe wydawane są zgodnie z zasadami i warunkami dotyczącymi płatności.</h2>\n<h2></h2>\n<h2>Zakupy biznesowe</h2>\n<h2></h2>\n<h2>Karty podarunkowe nie podlegają zwrotom i nie mogą być wymieniane na gotówkę.</h2>\n<h2></h2>\n<h2>Odstąpienie</h2>\n<h2></h2>\n<h2>Karty podarunkowe wydawane w związku z konkursami, promocjami i w zestawach (bundle) nie mogą być wymieniane na gotówkę.</h2>','regulamin'),
('4','1','1','O nas',NULL,'Learn more about us','about us, informations','<h1 style=\"font-size:25px;margin:17px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;line-height:1.1;letter-spacing:0.24px;\">O nas</h1>\n<h2 class=\"site-hash-tag-link\" style=\"color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;line-height:1.1;margin-bottom:8.5px;margin-top:17px;font-size:16px;letter-spacing:0.24px;\">Wizja</h2>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:14px;font-weight:400;letter-spacing:0.24px;\"></p>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:14px;font-weight:400;letter-spacing:0.24px;\">Proshop a/s chciałby zostać preferowanym dostawcą elektroniki w Polsce. Chcemy być znani z dostarczania tanich produktów o wysokiej jakości i jednocześnie pozostawiać u naszych klientów dobre wrażenie z zakupów.</p>\n<h2 class=\"site-hash-tag-link\" style=\"color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;line-height:1.1;margin-bottom:8.5px;margin-top:17px;font-size:16px;letter-spacing:0.24px;\">Misja</h2>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:14px;font-weight:400;letter-spacing:0.24px;\"></p>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:14px;font-weight:400;letter-spacing:0.24px;\">Proshop ma dostęp online do ponad 200 000 różnych produktów, które w każdej chwili możemy wprowadzić na naszej platformie transakcyjnej. Postawiliśmy sobie za zadanie zaprezentowanie naszym klientom najbardziej atrakcyjnych części tego asortymentu, abyśmy byli pewni, że zawsze będziemy w stanie oferować najbardziej pożądane produkty, zarówno pod względem ceny, jak i jakości.</p>\n<h2 class=\"site-hash-tag-link\" style=\"color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;line-height:1.1;margin-bottom:8.5px;margin-top:17px;font-size:16px;letter-spacing:0.24px;\">Cele</h2>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:14px;font-weight:400;letter-spacing:0.24px;\">Poul Thyregod wraz z 3 partnerami założył firmę Proshop a/s w roku 1995. Proshop a/s rozpoczął swoją działalność jako sklep detaliczny w zakresie sprzedaży produktów multimedialnych i innych elementów związanych z IT. Proshop a/s uruchomił jeden z pierwszych w Danii sklep internetowy w roku 1996, a w roku 2005 zamknął swój fizyczny sklep i od tego momentu przeszedł w 100% do sprzedaży online. W roku 1999 Poul Thyregod wykupił udziały pozostałych partnerów i stał się wyłącznym właścicielem firmy. Dziś firma Proshop a/s sprzedaje swoje produkty w Danii, Norwegii, Szwecji, Finlandii, Niemczech, Austrii i Polsce. Oferta sklepu obejmuje obecnie ponad 200 000 różnych produktów w wielu kategoriach. Każdego dnia wysyłanych jest kilka tysięcy paczek, a w ciągu ostatnich kilku lat klienci sklepu Proshop a/s dokonali ponad 1,5 miliona zamówień online. Firma Proshop a/s opiera się na dobrej znajomości biznesu i zdrowym rozsądku. W tym przypadku naturalne jest, aby zawsze być dostępnym dla klientów, zapewniać najlepszą obsługę klienta na świecie i zawsze posiadać odpowiednie produkty w atrakcyjnych cenach. Obecnie firma jest własnością pierwotnego właściciela jakim jest Poul Thyregod i A. Wilhelmsen Capital A/S.</p>\n<h2 class=\"site-hash-tag-link\" style=\"color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;line-height:1.1;margin-bottom:8.5px;margin-top:17px;font-size:16px;letter-spacing:0.24px;\">Informacje</h2>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:14px;font-weight:400;letter-spacing:0.24px;\"></p>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:14px;font-weight:400;letter-spacing:0.24px;\">Proshop a/s<br />Slet Moellevej 17<br />DK-8270 Hoejbjerg<br />Dania<br /><br />Numer telefonu: +48223978986<br />Numer NIP: DK18966239 EU 2021 One Stop Shop (OSS)<br />Kod branży: 47 41 00<br /><br /><span style=\"font-weight:bold;\">Informacje bankowe</span> </p>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:14px;font-weight:400;letter-spacing:0.24px;\">Bank: Danske Bank A/S S.A. Branch in Poland<br />Konto bankowe: 04 2360 0005 0000 0045 5010 0805<br />Kod SWIFT / BIC: DABAPLPW<br />IBAN: PL04 2360 0005 0000 0045 5010 0805<br /><br /><br /><br /></p>\n<h2 class=\"site-hash-tag-link\" style=\"color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;line-height:1.1;margin-bottom:8.5px;margin-top:17px;font-size:16px;letter-spacing:0.24px;\">Bank</h2>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:14px;font-weight:400;letter-spacing:0.24px;\">Proshop a/s używa Danske Bank A/S.<br /><br />Numer konta: 04 2360 0005 0000 0045 5010 0805</p>','o-nas'),
