('1','1','1','<h3 style=\"color:#0f2f56;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;line-height:1.1;margin-bottom:8.5px;margin-top:17px;font-size:16px;letter-spacing:0.24px;\">PROSHOP &gt;&gt; JESZCZE WIĘCEJ &gt;&gt;&gt; JESZCZE TANIEJ</h3>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;font-weight:400;letter-spacing:0.24px;\">Czy Ty też kochasz elektronikę? A może oczekujesz po prostu dużo więcej produktów w jeszcze lepszych cenach?</p>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;font-weight:400;letter-spacing:0.24px;\">W takim razie trafiłeś w idealne miejsce. Proshop.pl jest dla każdego! Aktualnie posiadamy ponad 400 kategorii produktowych. W naszej sprzedaży znajdziesz: sprzęt komputerowy, oprogramowania, gadżety, artykuły gospodarstwa domowego, produkty do pielęgnacji, sprzęt do fitnessu, zabawki dla dzieci i wiele więcej. Jesteśmy tu, aby ułatwić Ci zakupu i posiadamy wszystko w jednym miejscu online, a zamówienia realizujemy z dostawą do domu.</p>\n<h3 style=\"color:#0f2f56;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;line-height:1.1;margin-bottom:8.5px;margin-top:17px;font-size:16px;letter-spacing:0.24px;\"><span>Jeszcze więcej</span></h3>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;font-weight:400;letter-spacing:0.24px;\">Posiadamy tak wiele i wciąż poszerzamy naszą ofertę.</p>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;font-weight:400;letter-spacing:0.24px;\">Szczycimy się tym, że posiadamy jeden z największych asortymentów elektroniki i IT w Danii. Nasza oferta jest bardzo szeroka - od własnych <span style=\"font-weight:bold;\"><a href=\"https://www.proshop.pl/Dutzo\" style=\"background-color:transparent;color:#0f2f56;\">komputerów DUTZO,</a></span> przez monitory komputerowe, aż po najpotężniejsze <span style=\"font-weight:bold;\"><a href=\"https://www.proshop.pl/Karta-graficzna\" style=\"background-color:transparent;color:#0f2f56;\">karty graficzne</a></span> na rynku.</p>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;font-weight:400;letter-spacing:0.24px;\">Nie ograniczamy się i poszerzamy również naszą sprzedaż na Europę. Aktualnie prowadzimy sprzedaż już w 8 krajach europejskich.</p>\n<h3 style=\"color:#0f2f56;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;line-height:1.1;margin-bottom:8.5px;margin-top:17px;font-size:16px;letter-spacing:0.24px;\"><span>Jeszcze szybciej</span></h3>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;font-weight:400;letter-spacing:0.24px;\">Błyskawiczna dostawa to znak rozpoznawczy firmy Proshop w Danii. Dostawa na teren Polski to tylko 3-4 dni robocze. Zamówienia z produktami dostępnymi na magazynie realizujemy jeszcze tego samego dnia.</p>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;font-weight:400;letter-spacing:0.24px;\">Na naszym magazynie posiadamy ogromnego robota AutoStore, który codziennie pomaga przy pakowaniu zamówień. Nasz AutoStore to 112 robotów, które sprawnie poruszają się po powierzchni pudełek ułożonych jeden na drugim, a jest ich już ponad 100 tysięcy. Roboty przywożą pudełka do stacji do pakowania lub do naszej ogromnej maszyny pakującej zamówienia z technologią pakowania Fit-to-size.</p>\n<h3 style=\"color:#0f2f56;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;line-height:1.1;margin-bottom:8.5px;margin-top:17px;font-size:16px;letter-spacing:0.24px;\"><span>Jeszcze taniej</span></h3>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;font-weight:400;letter-spacing:0.24px;\">W Proshop jesteśmy przygotowania na każdą okazję – urodziny, imieniny, Black Friday. Ponadto nasz <span style=\"font-weight:bold;\"><a href=\"https://www.proshop.pl/Black-Friday\" style=\"background-color:transparent;color:#0f2f56;\">Black Friday</a></span> trwa dłużej niż tylko jeden dzień. Największe wydarzenie zakupowe roku świętujemy tygodniem z promocjami, czyli Black Week, następnie wyrzucamy bombę z ofertami na Black Friday i nieprzerwanie przez cały weekend możesz znaleźć u nasz jeszcze większe promocje – a to oznacza Black Weekend.</p>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;font-weight:400;letter-spacing:0.24px;\">Nie obejdzie się bez święta zakupów online. W Proshop przygotowaliśmy jeszcze więcej wspaniałych ofert na <span style=\"font-weight:bold;\"><a href=\"https://www.proshop.pl/Cyber-Monday\" style=\"background-color:transparent;color:#0f2f56;\">Cyber Monday</a></span></p>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;font-weight:400;letter-spacing:0.24px;\">W Proshop jesteśmy maniakami. W przeciwnym razie nie bylibyśmy w stanie zaoferować wszystkich tych produktów w tak doskonałych cenach.</p>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;font-weight:400;letter-spacing:0.24px;\">Nie ograniczaj się! U nas masz ogromne możliwości, również zakupu wszystkich prezentów świątecznych. Zajrzyj na naszą stronę z <span style=\"font-weight:bold;\"><a href=\"https://www.proshop.pl/Przewodnik-Swiateczny\" style=\"background-color:transparent;color:#0f2f56;\">Przewdnikiem Świątecznym</a></span>, gdzie znajdziesz wiele ciekawych ofert i inspiracji.</p>\n<p style=\"margin:0px 0px 8.5px;color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;font-weight:400;letter-spacing:0.24px;\">W tym roku już od 1 listopada możesz zakupić prezent świąteczny, a możliwość zwrotu lub wymiany wydłuża się aż do 31 stycznia.</p>\n<h3 style=\"color:#0f2f56;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;line-height:1.1;margin-bottom:8.5px;margin-top:17px;font-size:16px;letter-spacing:0.24px;\"><span>Udanych zakupów!</span></h3>');
